INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(46, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(46, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'Ground power is available to supply power to the electrical system.', 'The aircraft electrical system is powered.', 'The ground air supply is supplying bleed air to the packs.', 'All of the above.', 'a'),
(46, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'All electrical busses except the shed busses.', 'DC bus 1 and DC bus 2', 'The hot battery busses, essential busses, and the central DC bus.', 'The entire electrical system.', 'c'),
(46, 17, 'c2', 'elec', 'The APU can be started using:', 'Battery 2.', 'Battery 1.', 'The GPU (with batteries in AUTO)', 'A and C are correct.', 'd'),
(46, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'FOR-DME approaches can be flown using the standby instruments.', 'VOR (no DME) can be flown using the RMU navigation page', 'VOR approaches are impossible since the PFD is blank.', 'The FMS remains powered.', 'b'),
(47, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The ground air supply is supplying bleed air to the packs.', 'The aircraft electrical system is powered.', 'Ground power is available to supply power to the electrical system.', 'The ground power unit is disconnected from the aircraft.', 'c'),
(47, 17, 'c2', 'elec', 'The APU can be started using:', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'Battery 1.', 'A and B are correct.', 'd'),
(47, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'The entire electrical system.', 'All electrical busses except the shed busses.', 'DC bus 1 and DC bus 2', 'The hot battery busses, essential busses, and the central DC bus.', 'd'),
(47, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'FOR-DME approaches can be flown using the standby instruments.', 'VOR (no DME) can be flown using the RMU navigation page', 'd'),
(47, 9, 'mc', 'elec', 'Fuel control and starting for the APU (Model T-62T-40C14) is provided from:', 'Starter/Generator', 'Manual controls', 'FADEC', 'EICAS', 'c'),
(48, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '54 C', '70 C', '40 C', '-20 C', 'd'),
(48, 4, 'mc', 'crew_awareness', 'If symbol generator 1 fails:', 'The EICAS reversionary buttons must be pressed to activate channel B.', 'PFD1 and MFD1 go blank.', 'RMU 1 automatically displays Engine Page 1', 'All of the above.', 'c'),
(48, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'Airspeed will be covered with hash marks', 'ATT FAIL appears on the EADI on the PFD.', 'd'),
(48, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'All electrical busses except the shed busses.', 'The hot battery busses, essential busses, and the central DC bus.', 'DC bus 1 and DC bus 2', 'The entire electrical system.', 'b'),
(48, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR (no DME) can be flown using the RMU navigation page', 'The FMS remains powered.', 'FOR-DME approaches can be flown using the standby instruments.', 'VOR approaches are impossible since the PFD is blank.', 'a'),
(49, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(49, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the pack is too hot.', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'None of the above.', 'a'),
(50, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Pack 1 turns off.', 'Both packs stay on.', 'Pack 2 turns off.', 'a'),
(50, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'B and C are correct.', 'd'),
(50, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air entering the compressor is too hot.', 'The air leaving the pack is too hot.', 'The air entering the pack is too hot.', 'None of the above.', 'b'),
(50, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Baggage compartment door.', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'Under cockpit access hatch.', 'd'),
(50, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'EICAS', 'Starter/Generator', 'Manual controls', 'FADEC', 'd'),
(50, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '40 C', '-20 C', '70 C', '54 C', 'b'),
(50, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'Immediately at all times.', 'After 10 seconds on the ground.', 'AFter 10 seconds on the ground, immediately in flight.', 'Immediately in flight.', 'b'),
(50, 12, 'mc', 'apu', 'The maximum load on the APU generator above FL300 is:', '200 Amps.', '300 Amps.', '400 Amps.', '500 Amps.', 'b'),
(51, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Pack 2 is on, 1 is off.', 'Pack 1 is on, 2 is off.', 'Both packs are on.', 'None of the above.', 'a'),
(51, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air entering the pack is too hot.', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the compressor is too hot.', 'b'),
(51, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd'),
(51, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '160 % of the length of an EMB-135.', '89 feet in length.', '98 feet in length.', '110 feet in length.', 'c'),
(51, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '40 C', '-20 C', '70 C', '54 C', 'b'),
(51, 34, 'mc', 'apu', 'The proper way to shut down the APU is to:', 'Press the FUEL SHUTOFF button.', 'Turn the master knob to OFF.', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'c'),
(51, 12, 'mc', 'apu', 'The maximum load on the APU generator above FL300 is:', '400 Amps.', '200 Amps.', '500 Amps.', '300 Amps.', 'd'),
(51, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 2.', 'Battery 1.', 'The GPU (with batteries in AUTO)', 'A and C are correct.', 'd'),
(51, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'FADEC', 'EICAS', 'Starter/Generator', 'Manual controls', 'a'),
(51, 45, 'mc', 'autopilot', 'When low bank is NOT selected, what is the maximum bank the autopilot will use for any lateral mode?', '27 degrees.', '14 degrees.', '13 degrees.', '10 degrees.', 'a'),
(51, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 18).', 'A and B are correct.', 'd'),
(52, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air leaving the compressor is too hot.', 'The air leaving the pack is too hot.', 'The air entering the pack is too hot.', 'The air entering the compressor is too hot.', 'b'),
(52, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Pack 1 turns off.', 'Both packs turn off.', 'Pack 2 turns off.', 'None of the above.', 'b'),
(52, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Pack 1 is on, 2 is off.', 'Both packs are off.', 'Both packs are on.', 'Pack 2 is on, 1 is off.', 'd'),
(52, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '110 feet in length.', '89 feet in length.', '98 feet in length.', '160 % of the length of an EMB-135.', 'c'),
(52, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'Immediately at all times.', 'AFter 10 seconds on the ground, immediately in flight.', 'After 10 seconds on the ground.', 'All of the above.', 'c'),
(52, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '-20 C', '40 C', '70 C', '54 C', 'a'),
(52, 9, 'mc', 'apu', 'Fuel control and starting for the APU (Model T-62T-40C14) is provided from:', 'Manual controls', 'FADEC', 'Starter/Generator', 'EICAS', 'b'),
(52, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 2.', 'Battery 1.', 'The GPU (with batteries in AUTO)', 'A and C are correct.', 'd'),
(52, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '23.5V', '19.0V', '20.0V', '24.0V', 'b'),
(52, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'VS mode but with preset vertical speeds', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'SPD mode but with preset speeds.', 'b'),
(52, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 18).', 'A and B are correct.', 'd'),
(52, 42, 'c2', 'autopilot', 'Which of these are vertical flight guidance modes?', 'PIT', 'FLC', 'ROL', 'A and B are correct.', 'd'),
(52, 45, 'mc', 'autopilot', 'Full bank is equal to ___: ?', '27 degrees.', '14 degrees.', '10 degrees.', '13 degrees.', 'a'),
(52, 37, 'mc', 'autopilot', 'What is the minimum engagement height for the autopilot (feet)?', '1000', '800', '500', '200', 'c'),
(52, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'Airspeed will be covered with hash marks', 'ATT FAIL appears on the EADI on the PFD.', 'd'),
(52, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'Engine #1 indications are replaced with amber dashes', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'All of the above.', 'a'),
(52, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR approaches are impossible since the PFD is blank.', 'The FMS remains powered.', 'VOR (no DME) can be flown using the RMU navigation page', 'FOR-DME approaches can be flown using the standby instruments.', 'c'),
(52, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'All electrical busses except the shed busses.', 'The hot battery busses, essential busses, and the central DC bus.', 'DC bus 1 and DC bus 2', 'The entire electrical system.', 'b'),
(52, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'Ground power is available to supply power to the electrical system.', 'The aircraft electrical system is powered.', 'The ground air supply is supplying bleed air to the packs.', 'None of the above.', 'a'),
(53, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the pack is too hot.', 'd'),
(53, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Both packs are off.', 'Both packs are on.', 'Pack 2 is on, 1 is off.', 'None of the above.', 'c'),
(53, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs stay on.', 'Pack 2 turns off.', 'Both packs turn off.', 'Pack 1 turns off.', 'c'),
(53, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Overwing emergency exit.', 'Baggage compartment door.', 'Forward nose hydraulic compartment.', 'Under cockpit access hatch.', 'd'),
(53, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '89 feet in length.', '160 % of the length of an EMB-135.', '110 feet in length.', '98 feet in length.', 'd'),
(53, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '54 C', '40 C', '-20 C', '70 C', 'c'),
(53, 32, 'mc', 'apu', 'In case of an APU fire, the APU shuts down:', 'After 10 seconds on the ground.', 'Immediately at all times.', 'Immediately in flight.', 'AFter 10 seconds on the ground, immediately in flight.', 'a'),
(53, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '24.0V', '23.5V', '19.0V', '20.0V', 'c'),
(53, 9, 'mc', 'apu', 'Fuel control and starting for the APU (Model T-62T-40C14) is provided from:', 'FADEC', 'EICAS', 'Starter/Generator', 'Manual controls', 'a'),
(53, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 1.', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'B and C are correct.', 'd'),
(53, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'HDG, then FMS.', 'HDG', 'NAV', 'All of the above.', 'c'),
(53, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'VS mode but with preset vertical speeds', 'SPD mode but with preset speeds.', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'a'),
(53, 42, 'c2', 'autopilot', 'Which of these are vertical flight guidance modes?', 'PIT', 'ROL', 'FLC', 'A and C are correct.', 'd'),
(53, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', 'B and C are correct.', 'd'),
(53, 39, 'mc', 'autopilot', 'What change should be observed on the FMA after clicking the TOGA buttons on the ground?', 'The thrust rating changes to full thrust.', 'GA mode is activated on the flight director.', 'TO mode is activated on the flight director.', 'The flight director shows a 10 degree pitch up indication for takeoff.', 'c'),
(53, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'Engine #1 indications are replaced with amber dashes', 'Aft aircraft systems information is unavailable.', 'c'),
(53, 3, 'mc', 'crew_awareness', 'Which one of these will not give you a takeoff configuration warning?', 'Pitch trim set to 0 degrees.', 'Parking brake set.', 'Flaps 0.', 'One or both enginges not running.', 'd'),
(53, 4, 'mc', 'crew_awareness', 'Which event is specific to a symbol generator 1 failure?', 'PFD1 and MFD1 go blank.', 'The EICAS reversionary buttons must be pressed to activate channel B.', 'Symbol generator 2 automatically supplies symbols to all 5 screens.', 'RMU 1 automatically displays Engine Page 1', 'd'),
