(84, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on, regardless of the emergency light switch position in the cockpit.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(84, 81, 'mc', 'crew_awareness', 'The power source for SG 2 is:', 'Essential bus 2', 'DC Bus 2', 'DC bus 1', 'Essential bus 1', 'b'),
(84, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '3', '0', '2', 'All of the above.', 'c'),
(84, 63, 'tf', 'crew_awareness', 'COM 3 cannot be used for voice communication when the EMER button is pushed in (selected) on the digital audio panel.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 59, 'tf', 'crew_awareness', 'The TBCH is the only means of tuning NAV2 in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(84, 61, 'mc', 'crew_awareness', 'The flight data recorder is activated (starts recording):', 'By a 5G impact or immersion in water.', 'By turning on the red beacon', 'As soon as the electrical system is powered.', 'By turning on the NAV lights.', 'b'),
(84, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Main cabin door only.', 'Fuel and baggage doors.', 'None of the above.', 'a'),
(84, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The standby airspeed indicator becomes unreliable.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'A and C are correct.', 'd'),
(84, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'Amber HDG flag above HSI.', 'SG 2', 'ATT FAIL, HDG FAIL on PFD.', 'None of the above.', 'c'),
(84, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'Engine #1 indications are replaced with amber dashes', 'All of the above.', 'c'),
(84, 4, 'mc', 'crew_awareness', 'Which event is specific to a symbol generator 1 failure?', 'PFD1 and MFD1 go blank.', 'RMU 1 automatically displays Engine Page 1', 'Symbol generator 2 automatically supplies symbols to all 5 screens.', 'The EICAS reversionary buttons must be pressed to activate channel B.', 'b'),
(84, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'Airspeed will be covered with hash marks', 'ATT FAIL appears on the EADI on the PFD.', 'd'),
(84, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By turning on the red beacon.', 'By a 5G impact or immersion in water.', 'By turning on the navigation lights.', 'As soon as the electrical system is powered.', 'd'),
(84, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'TBCH.', 'It doesn''t appear anywhere immediately.', 'MFD 1.', 'RMU 1.', 'b'),
(84, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'A difference of 6 degrees between the left and right AHRS headings.', 'Check your heading, you''re drifting from the assigned heading.', 'The heading system has failed.', 'The FMS is suggesting heading select navigation.', 'a'),
(84, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'SG reversion has been selected.', 'IAS displayed on each PFD differs by more than 5 knots.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'None of the above.', 'c'),
(84, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'SPEED HOLD flight director mode is on.', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Approaching maximum airspeed (redline).', 'c'),
(84, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'The digital audio panel is inoperative.', 'Only one aural channel is working.', 'Both aural channels have failed.', 'DAU2B has failed.', 'c'),
(84, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Can be presented by using MFD reversion.', 'Is automatically displayed on RMU 1', 'Can be presented by using SG reversion.', 'Is powered normally.', 'd'),
(84, 3, 'mc', 'crew_awareness', 'Which parameter is not evaluated for a takeoff configuration check?', 'Parking brake set.', 'Flaps 0.', 'Pitch trim set to 0 degrees.', 'One or both enginges not running.', 'd'),
(84, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is charged by the esential busses', 'Is not charged.', 'Is charged by the shed buses', 'Is charged only when the ELT switch is in the ARM position.', 'b'),
(84, 85, 'mc', 'crew_awareness', 'What does it look like on the 5 cockpit screens when you lose DC Bus 2?', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'b'),
(84, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot 1/Static ports 1 & 4.', 'Pitot/Static tube 3', 'Pitot 1/Fadec pressurization static port.', 'Pitot 2/Static ports 2 & 3.', 'b'),
(84, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'The hot battery busses, essential busses, and the central DC bus.', 'The entire electrical system.', 'All electrical busses except the shed busses.', 'DC bus 1 and DC bus 2', 'a'),
(84, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'VOR approaches are impossible since the PFD is blank.', 'The FMS remains powered.', 'VOR (no DME) can be flown using the RMU navigation page', 'None of the above.', 'c'),
(84, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are open.', 'The ALC is closed if the APU has been started.', 'BC 1 and BC 2 are closed.', 'BTC 1 & 2 are open.', 'a');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(84, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Opens the BBC, isolating the backup battery hot bus.', 'Allows a test of the ISIS on LR aircraft.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Removes power from the backup flight instruments.', 'a'),
(84, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'Weather Radar.', 'EGPWS/Wind Shear.', 'A and C are correct.', 'd'),
(84, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'All of the above.', 'a'),
(84, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'Is normal during a loss of all generators.', 'You are not in the essential power configuration but should be.', 'You have one electrical system despite having 4 or more generators on-line.', 'All of the above.', 'b'),
(84, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Normal gear extension.', 'Pressurization.', 'Roll trim.', 'None of the above.', 'a'),
(84, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '25 minutes.', '40 minutes.', '20 minutes.', '15 minutes.', 'b'),
(84, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'DC bus 2.', 'Backup hot bus.', 'Central DC bus.', 'Essential bus 2.', 'b'),
(84, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The aircraft electrical system is powered.', 'Ground power is available to supply power to the electrical system.', 'The ground air supply is supplying bleed air to the packs.', 'The ground power unit is disconnected from the aircraft.', 'b'),
(84, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'A and C are correct.', 'd'),
(84, 1, 'tf', 'elec', 'The emergency light system is powered from Essential DC Bus 2.', 'TRUE', 'FALSE', '', '', 'b'),
(84, 90, 'tf', 'elec', 'The ground service bus is not powered when the GPU is selected.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 13, 'mc', 'elec', 'What items are available in essential power?', 'SG2, DAU2B', 'FMS1, DAU1B, DAU2B', 'FMS, PFD and MFDs.', 'RMU1, RMU2, EICAS and standby instruments.', 'd'),
(84, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(84, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered.', 'All DC buses are powered except the shed buses.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'Only the esential buses can be powered.', 'b'),
(84, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Five, 24 Volt DC generators.', 'Four, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'Five, 28 Volt DC generators.', 'd'),
(84, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'c'),
(84, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'The Enhanced Emergency Master Kit (EEMK)', 'b'),
(84, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Has no effect on the hydraulic system.', 'Closes the associated hydraulic shutoff valve.', 'Shuts off all hydraulic pressure on the associated side.', 'c'),
(84, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '1', '3', '0', 'None of the above.', 'b'),
(84, 107, 'tf', 'fire_prot', 'APU fire detection and protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'b'),
(84, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'High pressure in the fire loop will trigger a FIRE warning message.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'APU fire detection and protection is available in essential power.', 'All of the above.', 'd'),
(84, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory.', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', 'A and B are correct.', 'd'),
(84, 104, 'mc', 'fire_prot', 'When a fire extinguishing handle is pulled:', 'The hydraulic shutoff valve is opened.', 'The respective engine fire bottle is discharged.', 'The engine will not shut down unless the thrust lever is in idle.', 'The fuel shutoff valve closes.', 'd'),
(84, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven fuel pump.', 'All of the above.', 'd'),
(84, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(84, 113, 'mc', 'fire_prot', 'Which of the following messages would indicate a good fire test?', 'E1(2) Fire Det Fail.', 'E1(2) EXTBL A(B) INOP', 'APU Fire Loop Fail', 'Lav Smoke', 'a'),
(84, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Start/Stop Selector - STOP.', 'Fire extinguishing handle - PULL & ROTATE.', 'Thrust lever - IDLE.', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'c'),
(84, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'A and B are correct.', 'd'),
(84, 119, 'mc', 'flt_control', 'The gust lock prevents the movement of the:', 'Rudder.', 'Elevator', 'Ailerons.', 'None of the above.', 'b'),
(84, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a mis-threading of the ball-screw actuator.', 'Indicates a failure of the flap velocity sensor.', 'Indicates a failure of the teleflex cable.', 'Indicates a flap motor failure.', 'd'),
(84, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The flap lever has to be at 0 or 9 degrees.', 'The speedbrake lever has to be selected to OPEN.', 'A low TLA (thrust lever angle).', 'All of the above.', 'd'),
(84, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a'),
(84, 138, 'mc', 'fuel', 'If the fuel boost bump fails:', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will continue to run by suction feed through a check valve.', 'c'),
(84, 137, 'tf', 'fuel', 'Crossfeeding will not inhibit transfer of fuel from the ventral tank to the wing tanks.', 'TRUE', 'FALSE', '', '', 'b'),
(84, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'One wing tank reaches 1863 lbs.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'd'),
(84, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 1.', 'Closing the fuel shutoff value in tank 2.', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 2.', 'a'),
(85, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Pack 1 is on, 2 is off.', 'Pack 2 is on, 1 is off.', 'Both packs are on.', 'All of the above.', 'b'),
(85, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Pack 2 turns off.', 'Both packs stay on.', 'Both packs turn off.', 'Pack 1 turns off.', 'c'),
(86, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '3000 psi.', '2900 psi.', '0 psi.', '1600 psi.', 'c'),
(86, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Extend normally using the gear handle.', 'Are held up by a mechanical uplock.', 'Freefall (freefall).', 'None of the above.', 'c'),
(86, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric pump only if the engine is shut down.', 'Turns on the electric pump regardless of system pressure.', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'b'),
(86, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Low power settings.', 'Cross-bleed starts.', 'External air starts.', 'None of the above.', 'c'),
(86, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'A line, no OPEN inscription.', 'No line, no open inscription.', 'None of the above.', 'b'),
(87, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump does not operate unless the ON position is selected.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'A and C are correct.', 'd'),
(87, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Emergency brakes.', 'Nosewheel steering.', 'Ailerons and rudder should all presure be lost.', 'None of the above.', 'd'),
(87, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'EICAS.', 'The RMU Engine page 1.', 'MFD ECS/AI page.', 'None of the above.', 'd'),
(87, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
(87, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, closed.', 'OPEN, open.', 'CLOSED, closed.', 'All of the above.', 'a'),
(87, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(88, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump does not operate unless the ON position is selected.', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'B and C are correct.', 'd'),
(88, 151, 'mc', 'hydraulics', 'Hydraulic system 1 provides pressure to:', 'The nose-wheel steering.', 'The inboard flaps.', 'The parking brake.', 'The rudder above 135 KIAS.', 'a'),
(88, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Emergency brakes.', 'Nosewheel steering.', 'Ailerons and rudder should all presure be lost.', 'None of the above.', 'd'),
(88, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(88, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
