(89, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '25,000''.', '24,600''.', '14,000'' +/- 500''.', '1700'' AGL.', 'a'),
(89, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the ADCs.', 'Provide static information to the CPAM.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'a'),
