(91, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Both hydraulic systems.', 'Hydraulic system 2 only.', 'Hydraulic system 1 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'a'),
(91, 149, 'mc', 'hydraulics', 'The priority value in hydraulic system 1 provides:', 'Gives hydraulic system 1 priority over hydraulic system 2.', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'Ensures hydraulic pressure to the landing gear when operating on the electric hydraulic pump.', 'Allows hydraulic system 2 to assisty hydraulic system 1 in low pressure situations.', 'b'),
(91, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '2900 psi.', '0 psi.', '1600 psi.', '3000 psi.', 'b'),
(91, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever visible moisture is present.', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'Whenever the temperature is 10 C or less.', 'Whenever the TAT heating is selected ON.', 'b'),
(91, 170, 'mc', 'ice_rain_prot', 'During the first part of ice test B (ground portion), which of the following should occur?', 'ICE CONDITION EICAS message.', 'AOA 1(2) HEAT INOP.', 'Hold the test switch for twenty seconds.', 'None of the above.', 'a'),
(91, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The essential buses.', 'DC Bus 1.', 'DC Bus 2.', 'The shed bus.', 'a'),
(91, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'No ice test is needed.', 'The XR has boots.', 'There are clear ice-detectors on the wings.', 'd'),
(91, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'On the ground with a wheel speed at or below 25 kts.', 'They are never inhbited.', 'During a bleed overtemp.', 'With the FADEC Ref. anti-ice selected OFF.', 'a'),
(91, 14, 'c2', 'ldg_gear_brk', 'With a total loss of hydraulic system #1, the landing gear:', 'Must be extended with the freefall actuator.', 'Cannot be retracted once extended.', 'Operates using hydraulic system #2 pressure, but may be slower due to the priority valve', 'A and B are correct.', 'd'),
(91, 177, 'mc', 'ldg_gear_brk', 'If engine 1 is shutdown, how is the landing gear extended?', 'The landing gear freefalls as soon as engine 1 is shutdown.', 'With the landing gear handle as normal.', 'Using the electrical override switch.', 'Pulling the freefall lever.', 'b'),
(91, 190, 'tf', 'ldg_gear_brk', 'The purpose of the landing gear over-center brace is to keep the landing gear down and locked.', 'TRUE', 'FALSE', '', '', 'a'),
(91, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'DC bus.', 'Photo luminescent; no power source required.', 'Dedicated batteries.', 'Essential bus.', 'c'),
(91, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'Shed.', 'Essential.', 'Backup bus.', 'None of the above.', 'a'),
(91, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '300 amps.', '400 amps.', '250 amps.', '350 amps.', 'a'),
(91, 222, 'mc', 'limitations', 'On the takeoff roll, oil pressure reaches 118 PSI. The correct action is to ...', 'Disregard - this is a normal oil pressure on takeoff.', 'Abort the takeoff if below 80 knots.', 'Continue takeoff and start your timer.  Youa re time limited to 2 minutes.', 'None of the above.', 'c');
