(91, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', '170 knots.', '200 knots.', '160 knots.', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', 'c'),
(91, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'No.', 'Only if the crossfeed is on.', 'Yes, provided the flight crew advises ATC.', 'a'),
(91, 232, 'mc', 'oxy', 'Placing the passenger oxygen knob to ON will deploy the oxygen masks:', 'Anytime power is supplied.', 'Only in flight.', 'When cabin altitude exceeds 14,000 feet.', 'Only in essential power.', 'a'),
