(91, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd'),
(91, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air leaving the pack is too hot.', 'The air leaving the pack is too hot.', 'A massive leak detector has detected a bleed leak.', 'Air leaving the pre-cooler is too hot.', 'd'),
(91, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'External air starts.', 'Cross-bleed starts.', 'Ice test A.', 'Low power settings.', 'a'),
