(91, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All of the above.', 'c'),
(91, 260, 'mc', 'powerplant', 'Engine FADECs are powered by...', 'The essential buses during an electrical emergency.', 'The essential buses or the PMA depending on N2 RPM.', 'The PMA only.', 'The essential buses.', 'b'),
