(91, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'The FADEC reduces the thrust to idle automatically.', 'The thrust reverser stows automatically.', 'There is no automatic reaction.', 'All of the above.', 'a'),
(91, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a'),
