(91, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engines shuts down.', 'FADEC "A" automatically takes over.', 'The engine reverts to N1SYN mode.', 'Engine page 1 automatically appears on RMU1.', 'b'),
