(91, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'Continue the takeoff and perform the engine fire QRH after reaching V2.', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'The takeoff should be aborted if sufficient runway remains.', 'All of the above.', 'b'),
