(92, 85, 'mc', 'crew_awareness', 'What does it look like on the 5 cockpit screens when you lose DC Bus 2?', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'd'),
