(94, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory.', 'B and C are correct.', 'd'),
(94, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The hydraulic shutoff valve to the engine-driven fuel pump.', 'The fuel shutoff valve.', 'The engine bleed and lip anti-ice ice valves.', 'All of the above.', 'd'),
(94, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(94, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(94, 124, 'tf', 'flt_control', 'The ground spoilers open when the airplane is on the ground, wheel speed >25 kts and a low TLA.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(94, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '18 Degrees.', '45 Degrees.', 'A and C are correct.', 'd'),
(94, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The speedbrake lever has to be selected to OPEN.', 'The flap lever has to be at 0 or 9 degrees.', 'A low TLA (thrust lever angle).', 'All of the above.', 'd'),
(94, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'Hydraulic system 1 & 2.', 'Essential buses.', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'DC bus 1 & 2.', 'd'),
(94, 116, 'mc', 'flt_control', 'In essential power, the flaps:', 'Will operate at half speed.', 'Are operative under manual reversion.', 'Operate normally.', 'Will not operate.', 'd'),
(94, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(94, 140, 'mc', 'fuel', 'In essential power:', 'Only the A and B fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'No fuel boost pumps are available.', 'All fuel boost pumps are available.', 'a'),
(94, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The FCOC.', 'The ACOC.', 'Each fuel tank.', 'The left fuel tank.', 'd'),
(94, 137, 'tf', 'fuel', 'Crossfeeding will not inhibit transfer of fuel from the ventral tank to the wing tanks.', 'TRUE', 'FALSE', '', '', 'b'),
(94, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'One wing tank reaches 1863 lbs.', 'a'),
(94, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '1200 psi.', '1600 psi.', '3000 psi.', '2900 psi.', 'c'),
(94, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Ailerons and rudder should all presure be lost.', 'Nosewheel steering.', 'Emergency brakes.', 'None of the above.', 'd'),
(94, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, supplying 6 applications.', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Emergency brakes only, unlimited applications.', 'b'),
(94, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Not available.', 'Only the #2 pump is available for the emergency brakes.', 'Both available.', 'Only the #1 pump is available for landing gear extension.', 'a'),
(94, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The landing extends normally.', 'The flaps operate normally.', 'The flaps will not extend.', 'All of the above.', 'b'),
(94, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'Once the aircraft exits icing conditions.', 'By pressing the SPS test button (on the ground only).', 'By pressing the SPS test button at any time.', 'By pressing the quick disconnect button.', 'b'),
(94, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'PacK 1 is off, Pack 2 is on.', 'The engines bleed shoud be selected open.', 'The engines bleeds will always be closed.', 'The use of packs is only permitted if the APU bleed is available.', 'b'),
(94, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever visible moisture is present.', 'Whenever the temperature is 10 C or less.', 'Whenever the TAT heating is selected ON.', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'd'),
(94, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'With the FADEC Ref. anti-ice selected OFF.', 'On the ground with a wheel speed at or below 25 kts.', 'During a bleed overtemp.', 'All of the above.', 'b'),
(94, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'There are clear ice-detectors on the wings.', 'The XR has boots.', 'No ice test is needed.', 'b'),
(94, 178, 'c2', 'ldg_gear_brk', 'If down to hydraulic accumulator 2 only, the aircraft has:', 'Unlimited emergency brake applications.', 'At least 6 emergency brake applications.', 'Parking brake pressure for 24 hours.', 'B and C are correct.', 'd'),
(94, 184, 'mc', 'ldg_gear_brk', 'The landing gear freefall actuator, when pulled:', 'Requires no electrical or hydrualic power to extend the landing gear.', 'Uses hydraulic system 1 pressure to lower the gear.', 'Bypasses the landing gear handle to extend the gear hydrualically.', 'All of the above.', 'a'),
(94, 179, 'mc', 'ldg_gear_brk', 'The landing gear is normally help up ___ and extended ___.', 'Mechanically, hydrualically.', 'Hydraulically, Mechanically.', 'Mechanically, Mechanically.', 'All of the above.', 'a'),
(94, 198, 'mc', 'lighting', 'The courtesy lights:', 'Automatically shut off when the airplane is depowered.', 'Could deplete battery 2 unless turned OFF.', 'Knob must be left in the AUTO position.', 'All of the above.', 'b'),
(94, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'Essential.', 'DC.', 'Backup bus.', 'Shed.', 'd'),
(94, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '9 C.', '-65 C.', '-21.5 C.', '35 C.', 'c'),
(94, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Quick disconnect button, press and hold.', 'Pitch systems 1 & 2 off.', 'Control column hold firmly.', 'Actuate the pitch trim switch in the opposite direction.', 'c'),
(94, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS or MACH .63, whichever is lower.', '200 KIAS.', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS below 10,000 feet.', 'b'),
(94, 220, 'mc', 'limitations', 'The maximum ITT for engine start is ___.', '800 C.', '565 C.', '750 C.', '560 C.', 'a'),
(94, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '240 knots.', '250 knots.', '200 knots.', '180 knots.', 'c'),
(94, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-52 C.', '-30 C.', '-65 C.', '-45 C with momentary deviations to -50 C permitted.', 'd'),
(94, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'No.', 'Yes, provided the flight crew advises ATC.', 'Yes.', 'Only if the crossfeed is on.', 'c'),
(94, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL 370.', 'FL410.', 'FL450.', 'FL350.', 'a'),
(94, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-40 C.', '-20 F.', '-40 F.', '-20 C.', 'a'),
(94, 211, 'mc', 'limitations', 'The maximum tailwind component for takeoff and landing is ___.', '30 knots.', '15 knots.', '20 knots.', '10 knots.', 'd'),
(94, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL200.', 'FL350.', 'FL370.', 'FL300.', 'd'),
(94, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the after.  After running the appropriate QRH, when must the engine be shutdown?', '10 seconds.', 'It doesn''t.', '1 minute.', 'None of the above.', 'a'),
(94, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '400 amps.', '300 amps.', '250 amps.', '350 amps.', 'b'),
(94, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,500'' +/- 500 cabin altitude.', '14,000'' MSL.', '14,000'' AGL.', '10,000'' cabin altitude.', 'a'),
(94, 234, 'mc', 'oxy', 'The green flight crew oxygen system safety disk:', 'May indicate that an overpressure has occurred if missing.', 'Turns red when the pressure is low.', 'Is located within the oxygen servicing panel.', 'Prevents contamination of the discharge line.', 'a'),
(94, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'The engine bleed valve should automatically close.', 'All of the above.', 'd'),
(94, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line, no OPEN inscription.', 'Open inscription, no line.', 'No line, no open inscription.', 'A line and an OPEN inscription.', 'a'),
(94, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(94, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'During a cross-bleed start.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'When the override knob on the ice protection panel is in ENG.', 'None of the above.', 'a'),
(94, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'The 14th stage compressor only.', 'A and B are correct.', 'd'),
(94, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'External air starts.', 'Low power settings.', 'Ice test A.', 'Cross-bleed starts.', 'a'),
(94, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', '56.4 percent N2.', 'Approximately 30 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '12-14 percent N2.', 'b'),
(94, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'TO-1.', 'TO-RSV.', 'ALT-TO.', 'E-TO.', 'b'),
(94, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'ALT TO, TO, ETO.', 'ATO TO, TO RSV, ETO RSV.', 'TO, ETO, TO RSV.', 'None of the above.', 'a'),
(94, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '868 C.', '901 C.', '800 C.', '506 C.', 'c'),
(94, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '5 minutes.', '3 minutes.', '2 minutes.', 'All of the above.', 'c'),
(94, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'EICAS.', 'RMU maintenance page.', 'MFD takeoff page.', 'MFD Hydraulic page.', 'c'),
(94, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'PMA.', 'Engine oil pressure.', 'Fuel pressure.', '9th stage bleed air.', 'c'),
(94, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine keeps running in N1 reversionary mode.', 'The engine keeps running but thrust cannot be changed.', 'The engine shuts down.', 'The FADECS of the other engine take over, using the inter-nacelle data bus.', 'c'),
(94, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Shut the engine down immediately and call maintenance.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'All of the above.', 'c'),
(94, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the CPAM.', 'Provide static information to the ADCs.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'a'),
(94, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd'),
(94, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Desired cabin altitude.', 'Takeoff elevation.', 'Cruise altitude.', 'Landing elevation.', 'd'),
(94, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'Continue the takeoff and perform the engine fire QRH after reaching V2.', 'Perform the engine fire QRH at acceleration height after reaching Vfs.', 'The takeoff should be aborted if sufficient runway remains.', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'd'),
(94, 277, 'mc', 'radar', 'The RADAR gain knob:', 'Should always be turned to MAX.', 'Changes the intensity of each color displayed.', 'Should always be pulled out (VAR).', 'None of the above.', 'b'),
(94, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'If the SPS/ICE SPEEDs message is displayed.', 'If one channel of the SPS is inoperative.', 'If the airspeed is less than 200 kts.', 'During an SPS test.', 'b'),
(94, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'At 130 KIAS.', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'B and C are correct.', 'd'),
(95, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Pack 2 is on, 1 is off.', 'Pack 1 is on, 2 is off.', 'Both packs are on.', 'Both packs are off.', 'a'),
(95, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air entering the compressor is too hot.', 'The air entering the pack is too hot.', 'The air leaving the pack is too hot.', 'The air leaving the compressor is too hot.', 'c'),
(95, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Pack 1 turns off.', 'Both packs turn off.', 'Both packs stay on.', 'All of the above.', 'b'),
(95, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Forward nose hydraulic compartment.', 'Under cockpit access hatch.', 'Overwing emergency exit.', 'None of the above.', 'b'),
(95, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '110 feet in length.', '160 % of the length of an EMB-135.', '89 feet in length.', '98 feet in length.', 'd'),
(95, 12, 'mc', 'apu', 'The maximum load on the APU generator above FL300 is:', '300 Amps.', '500 Amps.', '400 Amps.', '200 Amps.', 'a'),
(95, 35, 'mc', 'apu', 'The APU''s logic commands an automatic shutdown for which of the following conditions in flight?', 'Fire.', 'Overtemperature.', 'High oil temperature.', 'Overspeed.', 'd'),
(95, 42, 'c2', 'autopilot', 'Which of these are vertical flight guidance modes?', 'PIT', 'FLC', 'ROL', 'A and B are correct.', 'd'),
(95, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'Use of pitch trim', 'The "AP" button on the Flight Guidance Control Panel', 'The quick disconnect button', 'All of the above.', 'd'),
(95, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'HDG, then FMS.', 'NAV', 'HDG', 'FMS', 'b'),
(95, 40, 'mc', 'autopilot', 'The aircraft heading must be within ___ degrees of the final approach course (front course) prior to selecting the APR or NAV mode.', '100', '45', '70', '90', 'd'),
(95, 39, 'mc', 'autopilot', 'What change should be observed on the FMA after clicking the TOGA buttons on the ground?', 'The flight director shows a 10 degree pitch up indication for takeoff.', 'TO mode is activated on the flight director.', 'GA mode is activated on the flight director.', 'The thrust rating changes to full thrust.', 'b'),
(95, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Fuel and baggage doors.', 'Main and service doors.', 'Over-wing emergency exit.', 'All of the above.', 'b'),
(95, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot/Static tube 3', 'Pitot 1/Static ports 1 & 4.', 'Pitot 1/Fadec pressurization static port.', 'Pitot 2/Static ports 2 & 3.', 'a'),
(95, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'Airspeed will be covered with hash marks', 'ATT FAIL appears on the EADI on the PFD.', 'The cross-side AHRS automatically takes over.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'b'),
(95, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '0', '1', '2', 'All of the above.', 'c'),
(95, 63, 'tf', 'crew_awareness', 'COM 3 cannot be used for voice communication when the EMER button is pushed in (selected) on the digital audio panel.', 'TRUE', 'FALSE', '', '', 'a'),
(95, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'ATT FAIL, HDG FAIL on PFD.', 'SG 2', 'Amber HDG flag above HSI.', 'MAG 2, ATT 2.', 'a'),
(95, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'A disagreement between IC-600''s on EICAS messages displayed.', 'SG reversion has been selected.', 'IAS displayed on each PFD differs by more than 5 knots.', 'All of the above.', 'a'),
(95, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is not charged.', 'Is charged only when the ELT switch is in the ARM position.', 'Is charged by the esential busses', 'Is charged by the shed buses', 'a'),
(95, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'PFD 2 and MFD 2 are blank.', 'a'),
(95, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'Aft aircraft systems information is unavailable.', 'Engine #1 indications are replaced with amber dashes', 'd'),
(95, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(95, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Four, 28 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Five, 24 Volt DC generators.', 'Four, 24 Volt DC generators.', 'b'),
(95, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(95, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are closed.', 'The ALC is closed if the APU has been started.', 'BC 1 and BC 2 are open.', 'All of the above.', 'c'),
(95, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'The hot battery busses, essential busses, and the central DC bus.', 'DC bus 1 and DC bus 2', 'The entire electrical system.', 'All electrical busses except the shed busses.', 'a'),
(95, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'Only the esential buses can be powered.', 'All DC buses are powered.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered except the shed buses.', 'd'),
(95, 92, 'c2', 'elec', 'The shed buses are powered:', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'B and C are correct.', 'd'),
(95, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Flaps.', 'Pressurization.', 'Roll trim.', 'Normal gear extension.', 'd'),
(95, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The ground air supply is supplying bleed air to the packs.', 'The ground power unit is disconnected from the aircraft.', 'Ground power is available to supply power to the electrical system.', 'None of the above.', 'c'),
(95, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'Backup hot bus.', 'Essential bus 2.', 'Central DC bus.', 'DC bus 2.', 'a'),
(95, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'b'),
(95, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'The Enhanced Emergency Master Kit (EEMK)', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'c'),
(95, 113, 'mc', 'fire_prot', 'Which of the following messages would indicate a good fire test?', 'E1(2) Fire Det Fail.', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'Lav Smoke', 'a'),
(95, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Closes the associated hydraulic shutoff valve.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Shuts off all hydraulic pressure on the associated side.', 'Has no effect on the hydraulic system.', 'a'),
(95, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'All of the above.', 'd'),
(95, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Thrust lever - IDLE.', 'Start/Stop Selector - STOP.', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'Fire extinguishing handle - PULL & ROTATE.', 'a'),
(95, 127, 'mc', 'flt_control', 'Ailerons are positioned utilizing:', 'Offside hydraulic pressure only.', 'Mechanical Means.', 'Onside hydraulic pressure only.', 'Both hydraulic systems.', 'd'),
(95, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '22 Degrees.', '18 Degrees.', 'A and C are correct.', 'd'),
(95, 123, 'mc', 'flt_control', 'Elevator trim is accomplished by:', 'Positioning the elevator with the main or backup trim switches.', 'Positioning the fixed trim tab; the spring tab is a servo tab only.', 'Positioning the spring and fixed tabs on the trailing edges of the elevator.', 'Positioning the horizontal stabilizer.', 'd'),
(95, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The rudder is in manual reversion.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The deflection is 5 degrees +/- 1 degree.', 'a'),
(95, 124, 'tf', 'flt_control', 'The ground spoilers open when the airplane is on the ground, wheel speed >25 kts and a low TLA.', 'TRUE', 'FALSE', '', '', 'a'),
(95, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 1.', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 1.', 'a'),
(95, 140, 'mc', 'fuel', 'In essential power:', 'No fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'All fuel boost pumps are available.', 'None of the above.', 'b'),
(95, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the pump in the low tank off.', 'All of the above.', 'b'),
(95, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'a'),
(95, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(95, 153, 'mc', 'hydraulics', 'Hydraulic system temperature can be monitored on the:', 'MFD hydraulic page.', 'Cannot be monitored.', 'The MFD hydraulic page for system 1 only.', 'All of the above.', 'b'),
(95, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Nosewheel steering.', 'Emergency brakes.', 'Ailerons and rudder should all presure be lost.', 'None of the above.', 'd'),
(95, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'The RMU Engine page 1.', 'MFD ECS/AI page.', 'EICAS.', 'None of the above.', 'd'),
(95, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Emergency brakes only, supplying 6 applications.', 'Emergency brakes only, unlimited applications.', 'Inboard spoilers, outboard brakes, landing gear.', 'Outboard spoilers, inboard brakes, emergency brakes.', 'a'),
