(95, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'No.', 'Only if the crossfeed is on.', 'All of the above.', 'a'),
(95, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Pitch systems 1 & 2 off.', 'Actuate the pitch trim switch in the opposite direction.', 'Control column hold firmly.', 'Quick disconnect button, press and hold.', 'c'),
