(98, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd'),
(98, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'The Enhanced Emergency Master Kit (EEMK)', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'a'),
(98, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', 'a'),
(98, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'The engine bleed and lip anti-ice ice valves.', 'All of the above.', 'd'),
(98, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(98, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(98, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'All of the above.', 'd'),
(98, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'Hydraulic system 1 & 2.', 'DC bus 1 & 2.', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'All of the above.', 'b'),
(98, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The rudder is in manual reversion.', 'The deflection is 5 degrees +/- 1 degree.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'c'),
(98, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Hydraulic system 1.', 'Both hydraulic systems.', 'Hydraulic system 2.', 'All of the above.', 'c'),
(98, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The flaps are extended to 22 degrees.', 'Hydraulic system 1 fails.', 'The thrust levers are in idle.', 'The gear is down.', 'a'),
(98, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a'),
(98, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(98, 138, 'mc', 'fuel', 'If the fuel boost bump fails:', 'The engine will continue to run, but at reduced thrust.', 'The engine will continue to run on boost pressure provided by the other two boost pumps.', 'The engine will eventually flame out due to lack of fuel.', 'The engine will continue to run by suction feed through a check valve.', 'b'),
(98, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used from the ventral tank first, then from the wings.', 'c'),
(98, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 2.', 'b'),
(98, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(98, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'MFD ECS/AI page.', 'The RMU Engine page 1.', 'EICAS.', 'None of the above.', 'd'),
(98, 157, 'mc', 'hydraulics', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'b'),
(98, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '3000 psi.', '2900 psi.', '0 psi.', '1600 psi.', 'c'),
(98, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Hydraulic system 1 only.', 'Hydraulic system 2 only, when above 135 KIAS.', 'Both hydraulic systems.', 'None of the above.', 'c'),
(98, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The landing extends normally.', 'The flaps will not extend.', 'The landing gear retracts normally.', 'The flaps operate normally.', 'd'),
(98, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'The essential buses.', 'The shed bus.', 'DC Bus 2.', 'DC Bus 1.', 'a'),
(98, 170, 'mc', 'ice_rain_prot', 'During the first part of ice test B (ground portion), which of the following should occur?', 'ICE CONDITION EICAS message.', '4 ''open'' inscriptions on the overhead panel.', 'AOA 1(2) HEAT INOP.', 'Hold the test switch for twenty seconds.', 'a'),
(98, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'Override to AUTO.', 'The override to ENG/test switch held for 20 seconds in each position.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'Override to ALL, test switch for 10 seconds minimum.', 'd'),
(98, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Not available.', 'On and cannot be turned off.', 'Available if selected on or in icing conditions.', 'All of the above.', 'b'),
(98, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'The XR has boots.', 'There are clear ice-detectors on the wings.', 'All of the above.', 'c'),
(98, 178, 'c2', 'ldg_gear_brk', 'If down to hydraulic accumulator 2 only, the aircraft has:', 'At least 6 emergency brake applications.', 'Unlimited emergency brake applications.', 'Parking brake pressure for 24 hours.', 'A and C are correct.', 'd'),
(98, 183, 'mc', 'ldg_gear_brk', 'In essential power, nosewheel steering:', 'Operates normally.', 'Operates normally, but only above 10 knots.', 'Is available, but with limited capability.', 'Is not available.', 'd'),
(98, 189, 'mc', 'ldg_gear_brk', 'Nosewheel steering utilizes:', 'Both hydraulic systems.', 'Hydraulic system 1.', 'Hydraulic system 2.', 'Is electropneumatic.', 'b'),
(98, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'DC bus.', 'Essential bus.', 'Dedicated batteries.', 'Photo luminescent; no power source required.', 'c'),
(98, 199, 'mc', 'lighting', 'Aisle path lighting in the XR consists of:', 'There is no aisle path lighting.', 'A steady set of green lights powered by DC bus 1.', 'Red and white lights powered by the backup battery.', 'Photo luminescent lighting.', 'd'),
(98, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', 'No maximum exists provided the roll trim is operative.', '900 lbs.', '800 lbs.', '100 lbs.', 'c'),
(98, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-20 F.', '-40 F.', '-40 C.', '-20 C.', 'c'),
(98, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 25 C.', 'ISA + 15 C.', 'ISA + 35 C.', 'ISA + 45 C.', 'c'),
(98, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL350.', 'FL200.', 'FL370.', 'FL300.', 'd'),
(98, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '20 degrees F.', '20 degrees C.', '40 degrees C.', '40 degrees F.', 'c'),
(98, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'No.', 'Only if the crossfeed is on.', 'a'),
(98, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Quick disconnect button, press and hold.', 'Pitch systems 1 & 2 off.', 'Control column hold firmly.', 'All of the above.', 'c'),
(98, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '-65 C.', '9 C.', '-21.5 C.', '35 C.', 'c'),
(98, 221, 'mc', 'limitations', 'The engines have been running for 8 minutes and the oil temperature is 40 C.  What action is appropriate?', 'Complete a static run-up to 88% N2 and allow the engines to stabilize.', 'Delay takeoff until the oil temperature is above 40 C.', 'Takeoff.', 'All of the above.', 'c'),
(98, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL 370.', 'FL350.', 'FL450.', 'b'),
(98, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-40.', '20.', '-20.', '-65.', 'a'),
(98, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '350 amps.', '400 amps.', '300 amps.', '250 amps.', 'c'),
(98, 220, 'mc', 'limitations', 'The maximum ITT for engine start is ___.', '560 C.', '750 C.', '565 C.', '800 C.', 'd'),
(98, 232, 'mc', 'oxy', 'Placing the passenger oxygen knob to ON will deploy the oxygen masks:', 'Anytime power is supplied.', 'Only in flight.', 'When cabin altitude exceeds 14,000 feet.', 'All of the above.', 'a'),
(98, 235, 'mc', 'oxy', 'To ensure adequate oxygen for dispatch, one must know the number of crew, oxygen pressure and:', 'Outisde air temperature.', 'Actual ramp temperature.', 'Cockpit temperature.', 'Current ATIS temperature.', 'c'),
(98, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line and an OPEN inscription.', 'Open inscription, no line.', 'No line, no open inscription.', 'A line, no OPEN inscription.', 'd'),
(98, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'When the override knob on the ice protection panel is in ENG.', 'During ice test A.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'During a cross-bleed start.', 'd'),
(98, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All bleeds open, PACKs on, cross bleed open.', 'c'),
(98, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
(98, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, open.', 'AUTO, closed.', 'OPEN, open.', 'CLOSED, closed.', 'b'),
(98, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(98, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Oil pump.', 'Ejector pump.', 'Engine driven generator.', 'Ejector pump.', 'b'),
(98, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'The engine shuts down automatically.', 'There is no automatic reaction.', 'The FADEC reduces the thrust to idle automatically.', 'The thrust reverser stows automatically.', 'c'),
(98, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'E-TO.', 'TO-RSV.', 'TO-1.', 'ALT-TO.', 'b'),
(98, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '5 minutes.', '2 minutes.', '3 minutes.', '1 minute.', 'b'),
(98, 250, 'mc', 'powerplant', 'The engine ignition system receives electrical power from:', 'The essential buses.', 'The PMA, only above 10% N2.', 'The PMA, only above 50% N2.', 'None of the above.', 'b'),
(98, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'All of the above.', 'd'),
(98, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Fails and the other FADEC takes over.', 'Automatically shuts down the engine.', 'Limits N1 to 106%.', 'All of the above.', 'b'),
(98, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engine reverts to N1SYN mode.', 'Engine page 1 automatically appears on RMU1.', 'FADEC "A" automatically takes over.', 'The engines shuts down.', 'c'),
(98, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'Fuel pressure.', 'PMA.', 'Engine oil pressure.', '9th stage bleed air.', 'a'),
(98, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Will depressurize up to FL370.', 'Is not useable in manual pressurization mode.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'B and C are correct.', 'd'),
(98, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 2 and 3.', 'Pitot/static tube 3.', 'The static/pressurization ports.', 'Static ports 1 and 4.', 'b'),
(98, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '7.8', '8.1', '7.5', '-0.3', 'd'),
(98, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Above a safe altitude.', 'Vfs.', 'Positive rate of climb.', 'Reaching acceleration height and then a speed of V2 + 15.', 'd'),
(98, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'GMAP mode is only available during ground operations.', 'The radar cannot be used on the ground.', 'Increasing gain increases receiver sensitivity.', 'Increasing gain increases the energy output from the antenna.', 'c'),
(98, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'During an SPS test.', 'If the SPS/ICE SPEEDs message is displayed.', 'If the airspeed is less than 200 kts.', 'If one channel of the SPS is inoperative.', 'd'),
(98, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Amber.', 'Red.', 'White', 'All of the above.', 'b'),
(100, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Pack 2 is on, 1 is off.', 'Pack 1 is on, 2 is off.', 'Both packs are on.', 'Both packs are off.', 'a'),
(100, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(100, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Under cockpit access hatch.', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'None of the above.', 'a'),
(100, 34, 'mc', 'apu', 'The proper way to shut down the APU is to:', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'Turn the master knob to OFF.', 'Press the FUEL SHUTOFF button.', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'd'),
(100, 12, 'mc', 'apu', 'The maximum load on the APU generator above FL300 is:', '400 Amps.', '500 Amps.', '200 Amps.', '300 Amps.', 'd'),
(100, 44, 'mc', 'autopilot', 'When selected, low bank is equal to ____ : ?', '10 degrees.', '13 degrees above FL250.', '14 degrees.', '27 degrees.', 'c'),
(100, 41, 'mc', 'autopilot', 'During descent, FLC works just like:', 'VS mode but with preset vertical speeds', 'VS and SPD mode. It maintains 290 KIAS from FL370 down to 10,000 then 1000ft/min.', 'SPD mode but with preset speeds.', 'PIT mode.  It maintains 5 degrees nose down from FL370 down to FL180 then linearly increases pitch to 3 degrees nose down.', 'a'),
(100, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Fuel and baggage doors.', 'Main and service doors.', 'Main cabin door only.', 'Over-wing emergency exit.', 'b'),
(100, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'MFD 1.', 'TBCH.', 'RMU 1.', 'It doesn''t appear anywhere immediately.', 'd'),
(100, 85, 'mc', 'crew_awareness', 'What does it look like on the 5 cockpit screens when you lose DC Bus 2?', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'c'),
(100, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'DAU2B has failed.', 'Both aural channels have failed.', 'Only one aural channel is working.', 'The digital audio panel is inoperative.', 'b'),
(100, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Flaps.', 'Pressurization.', 'Normal gear extension.', 'Roll trim.', 'c'),
(100, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Removes power from the backup flight instruments.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Opens the BBC, isolating the backup battery hot bus.', 'All of the above.', 'c'),
(100, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd'),
(100, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a'),
(100, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'b'),
(100, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV BOTTLE INOP EICAS warning appears.', 'The flight attendant hears a warning horn.', 'The LAV SMOKE EICAS warning appears.', 'None of the above.', 'd'),
(100, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'APU fire detection and protection is available in essential power.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'All of the above.', 'd'),
(100, 121, 'mc', 'flt_control', 'The maximum airspeed with flaps 18 is:', '200 KIAS.', '250 KIAS.', '160 KIAS.', '140 KIAS.', 'a'),
(100, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a flap motor failure.', 'Indicates a failure of the teleflex cable.', 'Indicates a failure of the flap velocity sensor.', 'Indicates a mis-threading of the ball-screw actuator.', 'a'),
(100, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 1.', 'All of the above.', 'a'),
(100, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the LR is ___ lbs.', '100.', '800.', '1000.', '365.', 'b'),
(100, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Extend normally using the gear handle.', 'Freefall (freefall).', 'Are held up by a mechanical uplock.', 'Are held up by system 1 accumulator pressure.', 'b'),
(100, 151, 'mc', 'hydraulics', 'Hydraulic system 1 provides pressure to:', 'The inboard flaps.', 'The nose-wheel steering.', 'The parking brake.', 'None of the above.', 'b'),
(100, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'The leading edge of the wings and the horizontal stabilizer.', 'Ice detectors.', 'TAT probes.', 'B and C are correct.', 'd'),
(100, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'During a bleed overtemp.', 'On the ground with a wheel speed at or below 25 kts.', 'With the FADEC Ref. anti-ice selected OFF.', 'They are never inhbited.', 'b'),
(101, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Pack 2 turns off.', 'Both packs stay on.', 'Pack 1 turns off.', 'a'),
(101, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The air leaving the pack is too hot.', 'All of the above.', 'c'),
(101, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '89 feet in length.', '160 % of the length of an EMB-135.', '110 feet in length.', '98 feet in length.', 'd'),
(101, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'Manual controls', 'Starter/Generator', 'FADEC', 'EICAS', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(101, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '24.0V', '23.5V', '20.0V', '19.0V', 'd'),
(101, 38, 'mc', 'autopilot', 'During climb, FLC works just like:', 'VS but with preset vertical speeds.', 'SPD but with preset speeds.', 'SPD with preset values below 10,000'' and VS with preset values above 10,000''.', 'PIT but with preset attitudes.', 'b'),
(101, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft to to hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', '14 degrees (once you are flaps 9).', '10 Degrees', '13 Degrees.', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', 'b'),
(101, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(101, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'Altitude displayed on each PFD differs by more than 200 feet.', 'A disagreement between IC-600''s on EICAS messages displayed.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'b'),
(101, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(101, 77, 'tf', 'crew_awareness', 'The standby airspeed indicator receives information from the ADCs.', 'TRUE', 'FALSE', '', '', 'b'),
(101, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The aircraft electrical system is powered.', 'The ground air supply is supplying bleed air to the packs.', 'Ground power is available to supply power to the electrical system.', 'None of the above.', 'c'),
(101, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS1, DAU1B, DAU2B', 'RMU1, RMU2, EICAS and standby instruments.', 'SG2, DAU2B', 'FMS, PFD and MFDs.', 'b'),
(101, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'The entire electrical system.', 'All electrical busses except the shed busses.', 'The hot battery busses, essential busses, and the central DC bus.', 'None of the above.', 'c'),
(101, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Opens the BBC, isolating the backup battery hot bus.', 'Removes power from the backup flight instruments.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Allows a test of the ISIS on LR aircraft.', 'a'),
(101, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'b'),
(101, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Shuts off all hydraulic pressure on the associated side.', 'Has no effect on the hydraulic system.', 'Closes the associated hydraulic shutoff valve.', 'd'),
(101, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'Thrust lever - IDLE.', 'Fire extinguishing handle - PULL & ROTATE.', 'Start/Stop Selector - STOP.', 'b'),
(101, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The gear is down.', 'The flaps are extended to 22 degrees.', 'The thrust levers are in idle.', 'Hydraulic system 1 fails.', 'b'),
(101, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'None of the above.', 'b'),
