(121, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'All of the above.', 'a'),
(121, 285, 'mc', 'mandatory', 'Which of the following is NOT part of a successful TCAS TEST:', 'PFD shows a red and greeen arc', 'MFD shows a traffic pattern of intruder symbols', 'PFD shows a green "TCAS TEST PASS" at the end of the test', 'All of the above.', 'c'),
(121, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'b'),
(121, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'b'),
(122, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs stay on.', 'Both packs turn off.', 'Only pack 1 turns off.', 'None of the above.', 'b'),
(122, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Both packs are on.', 'Pack 1 is on, 2 is off.', 'Pack 2 is on, 1 is off.', 'Both packs are off.', 'c'),
(122, 30, 'mc', 'acft_gen', 'An EMB-145 XR is approximately...', '110 feet in length.', '89 feet in length.', '160 % of the length of an EMB-135.', '98 feet in length.', 'd'),
(122, 9, 'mc', 'apu', 'Fuel control and starting for the APU (Model T-62T-40C14) is provided from:', 'FADEC', 'EICAS', 'Starter/Generator', 'All of the above.', 'a'),
(122, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '70 C', '40 C', '54 C', '-20 C', 'd'),
(122, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 9).', '14 degrees pitch up attitude (Flaps 18).', '13 degrees pitch up attitude (Flaps 18).', 'A and C are correct.', 'd'),
(122, 37, 'mc', 'autopilot', 'What is the minimum engagement height for the autopilot (feet)?', '800', '500', '1000', '200', 'b'),
(122, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Guidance Controller', 'Flight Director button on the Flight Guidance Control Panel', 'Flight Mode Anunciator (FMA).', 'Display Control Panel', 'c'),
(122, 42, 'c2', 'autopilot', 'Which of these are vertical flight guidance modes?', 'PIT', 'FLC', 'ROL', 'A and B are correct.', 'd'),
(122, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'FMS', 'HDG, then FMS.', 'NAV', 'None of the above.', 'c'),
(122, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'Approaching maximum airspeed (redline).', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'None of the above.', 'c'),
(122, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By turning on the navigation lights.', 'As soon as the electrical system is powered.', 'By turning on the red beacon.', 'By a 5G impact or immersion in water.', 'b'),
(122, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(122, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(122, 87, 'mc', 'crew_awareness', 'The following messages appear during an AHRS 2 failure, prior to reversion:', 'SG 2', 'Amber HDG flag above HSI.', 'ATT FAIL, HDG FAIL on PFD.', 'None of the above.', 'c'),
(122, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot 1/Fadec pressurization static port.', 'Pitot 2/Static ports 2 & 3.', 'Pitot/Static tube 3', 'Pitot 1/Static ports 1 & 4.', 'c'),
(122, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'It doesn''t appear anywhere immediately.', 'MFD 1.', 'RMU 1.', 'TBCH.', 'a'),
(122, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'The standby airspeed indicator becomes unreliable.', 'A and B are correct.', 'd'),
(122, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is not charged.', 'Is charged only when the ELT switch is in the ARM position.', 'Is charged by the shed buses', 'Is charged by the esential busses', 'a'),
(122, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '1', '2', '0', 'None of the above.', 'b'),
(122, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(122, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'A and B are correct.', 'd'),
(122, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'Weather Radar.', 'EGPWS/Wind Shear.', 'A and C are correct.', 'd'),
(122, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Is pushed during an electrical emergency to backup EDL logic.', 'Opens the BBC, isolating the backup battery hot bus.', 'Removes power from the backup flight instruments.', 'Allows a test of the ISIS on LR aircraft.', 'b'),
(122, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You are in essential power configuration but should not be.', 'Is normal during a loss of all generators.', 'You are not in the essential power configuration but should be.', 'None of the above.', 'c'),
(122, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The aircraft electrical system is powered.', 'The ground power unit is disconnected from the aircraft.', 'That the GPU is plugged in with some power available.', 'The ground air supply is supplying bleed air to the packs.', 'c'),
(122, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'DC bus 1 and DC bus 2', 'The hot battery busses, essential busses, and the central DC bus.', 'The entire electrical system.', 'All electrical busses except the shed busses.', 'b'),
(122, 90, 'tf', 'elec', 'The ground service bus is not powered when the GPU is selected.', 'TRUE', 'FALSE', '', '', 'a'),
(122, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'DC bus 2.', 'Essential bus 2.', 'Backup hot bus.', 'Central DC bus.', 'c'),
(122, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Pressurization.', 'Roll trim.', 'Flaps.', 'Normal gear extension.', 'd'),
(122, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', 'b'),
(122, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', 'The Enhanced Emergency Master Kit (EEMK)', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'c'),
(122, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'A and B are correct.', 'd'),
(122, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The flight attendant hears a warning horn.', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'None of the above.', 'd'),
(122, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Thrust lever - IDLE.', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'Start/Stop Selector - STOP.', 'Fire extinguishing handle - PULL & ROTATE.', 'a'),
(122, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(122, 118, 'mc', 'flt_control', 'When using speedbrakes in flight:', 'The inboard and outboard spoilers deploy using both systems.', 'The inboard spoilers deploy using hydraulic system 1 pressure.', 'The outboard spoilers deploy using hydraulic system 2 pressure.', 'The outboard spoilers deploy using hydraulic system 1 pressure.', 'c'),
(122, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '22 Degrees.', '9 Degrees.', '18 Degrees.', 'B and C are correct.', 'd'),
(122, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The speedbrake lever has to be selected to OPEN.', 'A low TLA (thrust lever angle).', 'The flap lever has to be at 0 or 9 degrees.', 'All of the above.', 'd'),
(122, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'Essential buses.', 'DC bus 1 & 2.', 'Hydraulic system 1 & 2.', 'c'),
(122, 123, 'mc', 'flt_control', 'Elevator trim is accomplished by:', 'Positioning the horizontal stabilizer.', 'Positioning the elevator with the main or backup trim switches.', 'Positioning the spring and fixed tabs on the trailing edges of the elevator.', 'None of the above.', 'a'),
(122, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'd'),
(122, 135, 'mc', 'fuel', 'Which statement is true concerning XR fuel use?', 'Fuel is used form the wings first. When the wing tanks are empty, fuel is supplied from the ventral tank.', 'The engines only use fuel from the wings.  When the wing tanks have less than 4630 lbs for 30 seconds, fuel from the ventral tank is transferred.', 'Fuel is used from the ventral tank first, then from the wings.', 'Fuel is transferred from the wings to the ventral tank when the ventral tank is not full.', 'b'),
(122, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(122, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'd'),
(122, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the XR is ___ lbs.', '800.', '1000.', '100.', '365.', 'a'),
(122, 149, 'mc', 'hydraulics', 'The priority value in hydraulic system 1 provides:', 'Gives hydraulic system 1 priority over hydraulic system 2.', 'Ensures hydraulic pressure to the landing gear when operating on the electric hydraulic pump.', 'Allows hydraulic system 2 to assisty hydraulic system 1 in low pressure situations.', 'Restricts hydraulic presure from the landing gear to the ensure pressure for the flight controls.', 'd'),
(122, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The flaps operate normally.', 'The landing extends normally.', 'The flaps will not extend.', 'None of the above.', 'a'),
(122, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Only the #2 pump is available for the emergency brakes.', 'Only the #1 pump is available for landing gear extension.', 'Not available.', 'Both available.', 'c'),
(122, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Emergency brakes only, supplying 6 applications.', 'Inboard spoilers, outboard brakes, landing gear.', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Emergency brakes only, unlimited applications.', 'a'),
(122, 147, 'mc', 'hydraulics', 'If hydraulic system 1 loses all pressure during flight, the nose wheel doors:', 'Are held up by a mechanical uplock.', 'Extend normally using the gear handle.', 'Are held up by system 1 accumulator pressure.', 'Freefall (freefall).', 'd'),
(122, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'The leading edge of the wings and the horizontal stabilizer.', 'TAT probes.', 'A and C are correct.', 'd'),
(122, 164, 'mc', 'ice_rain_prot', 'For ice protection to be activated automatically:', 'The TAT must be less than 10 C.', 'The TAT must be less than 0 C.', 'One or both ice detectos must be detecting ice.', 'None of the above.', 'c'),
(122, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is not available.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is on and cannot be turned off.', 'Is available with the override switch in ALL.', 'a'),
(122, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'No ice test is needed.', 'There are clear ice-detectors on the wings.', 'The XR has boots.', 'c'),
(122, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Comes from the 9th stage of the compressor only.', 'On and cannot be turned off.', 'Not available.', 'Available if selected on or in icing conditions.', 'b'),
(122, 182, 'mc', 'ldg_gear_brk', 'The emergency brake provides:', 'Locked wheel protection, but not touchdown protection.', 'Anti-skid protection only.', 'Touchdown protection, but not anti-skid protection.', 'No anti-skid protection.', 'd'),
(122, 177, 'mc', 'ldg_gear_brk', 'If engine 1 is shutdown, how is the landing gear extended?', 'With the landing gear handle as normal.', 'The landing gear freefalls as soon as engine 1 is shutdown.', 'Using the electrical override switch.', 'Pulling the freefall lever.', 'a'),
(122, 191, 'mc', 'ldg_gear_brk', 'In essential power, how should the landing gear be extended?', 'By normal means.', 'Free-fall lever.', 'Through use of hydraulic accumulator 2.', 'All of the above.', 'a'),
(122, 201, 'mc', 'lighting', 'What is the power source for the emergency lighting system on the 145 EP/LR?', 'Dedicated batteries.', 'Essential bus.', 'Photo luminescent; no power source required.', 'None of the above.', 'a'),
(122, 199, 'mc', 'lighting', 'Aisle path lighting in the XR consists of:', 'Photo luminescent lighting.', 'Red and white lights powered by the backup battery.', 'There is no aisle path lighting.', 'A steady set of green lights powered by DC bus 1.', 'a'),
(122, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the amber.  After running the appropriate QRH, when must the engine be shutdown?', '1 minute.', '10 seconds.', 'It doesn''t.', 'None of the above.', 'b'),
(122, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-40 C.', '-40 F.', '-20 C.', '-20 F.', 'a'),
(122, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '250 knots.', '200 knots.', '180 knots.', '240 knots.', 'b'),
(122, 221, 'mc', 'limitations', 'The engines have been running for 8 minutes and the oil temperature is 40 C.  What action is appropriate?', 'Takeoff.', 'Delay takeoff until the oil temperature is above 40 C.', 'Complete a static run-up to 88% N2 and allow the engines to stabilize.', 'All of the above.', 'a'),
(122, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS or MACH .63, whichever is lower.', '250 KIAS below 10,000 feet.', '200 KIAS.', 'd'),
(122, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-40.', '20.', '-65.', '-20.', 'a'),
(122, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Control column hold firmly.', 'Actuate the pitch trim switch in the opposite direction.', 'Pitch systems 1 & 2 off.', 'Quick disconnect button, press and hold.', 'a'),
(122, 211, 'mc', 'limitations', 'The maximum tailwind component for takeoff and landing is ___.', '15 knots.', '20 knots.', '10 knots.', '30 knots.', 'c'),
(122, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL 370.', 'FL410.', 'FL350.', 'FL450.', 'a'),
(122, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '100 lbs.', '900 lbs.', '800 lbs.', 'No maximum exists provided the roll trim is operative.', 'c'),
(122, 238, 'mc', 'oxy', 'During a rapid cabin depressurization, flight dec crew members receive oxygen from...', 'A fixed oxygen cylinder.', 'The PBE.', 'An oxygen generator.', 'A portable oxygen bottle.', 'a'),
(122, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b'),
(122, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Ice test A.', 'Low power settings.', 'External air starts.', 'None of the above.', 'c'),
(122, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th compressor stage in icing conditions.', 'The 14th stage compressor only.', 'A and B are correct.', 'd'),
(122, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'Anytime the ICE CONDITION EICAS message is displayed.', 'When the override knob on the ice protection panel is in ENG.', 'During ice test A.', 'During a cross-bleed start.', 'd'),
(122, 246, 'ac', 'pneum', 'During a bleed leak.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'Hot bleed air is escaping from the bleed lines.', 'All of the above.', 'd'),
(122, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'The air leaving the pack is too hot.', 'A massive leak detector has detected a bleed leak.', 'Air leaving the pack is too hot.', 'Air leaving the pre-cooler is too hot.', 'd'),
(122, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves can be open at the same time.', 'The APU bleed valve closes.', 'Both valves close.', 'None of the above.', 'b'),
(122, 262, 'mc', 'powerplant', 'During an engine start, fuel should be introduced at...', '12-14 percent N2.', 'Immediately after IGN is displayed on the EICAS.', '56.4 percent N2.', 'Approximately 30 percent N2.', 'd'),
(122, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'There is no automatic reaction.', 'The engine shuts down automatically.', 'The thrust reverser stows automatically.', 'The FADEC reduces the thrust to idle automatically.', 'd'),
(122, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The engine shuts down.', 'The other FADEC (same engine) immediately takes over.', 'The engine runs in idle until the pilot resets the FADEC.', 'c'),
(122, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'E-TO.', 'TO-1.', 'TO-RSV.', 'ALT-TO.', 'c'),
(122, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down immediately and call maintenance.', 'b'),
(122, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '5 minutes.', '1 minute.', '2 minutes.', 'None of the above.', 'c'),
(122, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'All of the above.', 'd'),
(122, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N1 via the tower shaft.', 'Reduction gears via the N1 turbine.', 'N2 via a linkage on the HP spool.', 'N2 via the tower shaft.', 'd'),
(122, 255, 'mc', 'powerplant', 'The A1/E engines are limited to ___ ITT.', '992 C for 90 seconds and up to 970 C for 5 minutes.', '948 C.', '901 continuous.', '880 for starting.', 'a'),
(122, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Cruise altitude.', 'Takeoff elevation.', 'Desired cabin altitude.', 'Landing elevation.', 'd'),
(122, 271, 'mc', 'pressurization', 'The maximum allowed negative cabin differential is ___ PSID:', '8.1', '7.5', '7.8', '-0.3', 'd'),
(122, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'The static/pressurization ports.', 'Static ports 1 and 4.', 'Pitot/static tube 3.', 'Static ports 2 and 3.', 'c'),
(122, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Vfs.', 'Positive rate of climb.', 'Reaching acceleration height and then a speed of V2 + 15.', 'Above a safe altitude.', 'c'),
(122, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'Increasing gain increases receiver sensitivity.', 'Increasing gain increases the energy output from the antenna.', 'The radar cannot be used on the ground.', 'GMAP mode is only available during ground operations.', 'a'),
(122, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'At 130 KIAS.', 'A and B are correct.', 'd'),
(122, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Is a normal message when flying through icing conditions and will go away once out of icing.', 'b'),
(122, 285, 'mc', 'mandatory', 'Which of the following is NOT part of a successful TCAS TEST:', 'MFD shows a traffic pattern of intruder symbols', 'RMU shows a green "TCAS TEST PASS" at the end of the test', 'PFD shows a red and greeen arc', 'PFD shows a green "TCAS TEST PASS" at the end of the test', 'd'),
(122, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'None of the above.', 'a'),
(122, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'b'),
(122, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Electric pumps to ON, 1600 psi.', 'c'),
(122, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'APU Fire Loop Fail', 'LAV SMOKE', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'c'),
(123, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(123, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air entering the pack is too hot.', 'The air entering the compressor is too hot.', 'The air leaving the compressor is too hot.', 'The air leaving the pack is too hot.', 'd'),
(123, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Baggage compartment door.', 'Forward nose hydraulic compartment.', 'Overwing emergency exit.', 'Under cockpit access hatch.', 'd'),
(123, 35, 'mc', 'apu', 'In flight, the APU will shut down automatically for which of the following?', 'Fire.', 'High oil temperature.', 'Overtemperature.', 'Overspeed.', 'd'),
(123, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '24.0V', '23.5V', '19.0V', '20.0V', 'c'),
(123, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The "AP" button on the Flight Guidance Control Panel', 'Use of pitch trim', 'The quick disconnect button', 'All of the above.', 'd'),
(123, 47, 'mc', 'autopilot', 'What vertical speed does FLC give you in a descent above 12,000 feet?', '1,000 feet per minute.', '3,000 feet per minute.', '2,000 feet per minute.', '3 degree glidepath.', 'c'),
(123, 37, 'mc', 'autopilot', 'What is the minimum engagement height for the autopilot (feet)?', '1000', '200', '800', '500', 'd'),
(123, 54, 'mc', 'autopilot', 'The FMA displays what messages after pressing the TOGA buttons on the ground?', 'ROL/GA', 'HDG/TO', 'ROL/TO', 'None of the above.', 'c'),
(123, 52, 'tf', 'autopilot', 'The autopilot will not engage with the YD inoperative', 'TRUE', 'FALSE', '', '', 'a'),
(123, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(123, 3, 'mc', 'crew_awareness', 'Which one of these will not give you a takeoff configuration warning?', 'Flaps 0.', 'Parking brake set.', 'One or both enginges not running.', 'Pitch trim set to 0 degrees.', 'c'),
(123, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'SPEED HOLD flight director mode is on.', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'All of the above.', 'b'),
