(127, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', '1 Halon fire bottle for the lavatory.', 'A and C are correct.', 'd'),
(127, 128, 'mc', 'flt_control', 'During normal cruise flight, the rudder Power Control Unit receives hydraulic pressure from:', 'Essential DC bus.', 'Hydraulic system 1.', 'Both hydraulic systems.', 'Hydraulic system 2.', 'd'),
(127, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'The rudder is in manual reversion.', 'The deflection is 5 degrees +/- 1 degree.', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'd'),
(127, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'The FMS shows fuel remaning on arrival of less thank 1800 lbs.', 'One wing tank reaches 1863 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'a'),
(127, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(127, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Nosewheel steering.', 'Ailerons and rudder should all presure be lost.', 'Emergency brakes.', 'None of the above.', 'd'),
(127, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '3000 psi.', '2900 psi.', '1600 psi.', '1200 psi.', 'a'),
(127, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is not available.', 'Is on and cannot be turned off.', 'Is available with the override switch in ALL.', 'b'),
(127, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'They are never inhbited.', 'During a bleed overtemp.', 'With the FADEC Ref. anti-ice selected OFF.', 'On the ground with a wheel speed at or below 25 kts.', 'd'),
(127, 158, 'mc', 'ice_rain_prot', 'The SPS/ICE SPEEDS EICAS message is cleared:', 'By pressing the quick disconnect button.', 'By pressing the SPS test button at any time.', 'By pressing the SPS test button (on the ground only).', 'All of the above.', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(127, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'PacK 1 is off, Pack 2 is on.', 'The engine bleeds shoud be selected open.', 'The use of packs is only permitted if the APU bleed is available.', 'The engines bleeds will always be closed.', 'b'),
(127, 190, 'tf', 'ldg_gear_brk', 'The purpose of the landing gear over-center brace is to keep the landing gear down and locked.', 'TRUE', 'FALSE', '', '', 'a'),
(127, 192, 'mc', 'ldg_gear_brk', 'What parameters allow us to cancel a landing gear aural warning message?', 'Any thrust lever angle, flaps 45.', 'Any thrust lever, RA inop, flaps 22.', 'RA inop, low thrust lever angle, flaps 0-18.', '<1200'' AGL, low thrust lever angle, flaps 0-22.', 'c'),
(127, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'Backup bus.', 'Essential.', 'DC.', 'Shed.', 'd'),
(127, 194, 'mc', 'lighting', 'Charging the XR photo luminescent aisle lights is the responsibility of the:', 'They no longer need to be charged.', 'Maintenance.', 'Flight crew.', 'Gate agent.', 'c'),
(127, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-40.', '20.', '-65.', '-20.', 'a'),
(127, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '200 KIAS.', '250 KIAS below 10,000 feet.', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS or MACH .63, whichever is lower.', 'a'),
(127, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', '170 knots.', '200 knots.', '160 knots.', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', 'c'),
(127, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 45 C.', 'ISA + 35 C.', 'ISA + 25 C.', 'ISA + 15 C.', 'b'),
(127, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-40 C.', '-20 F.', '-40 F.', '-20 C.', 'a'),
(127, 224, 'mc', 'oxy', 'In order to test the ACM''s oxygen mask, select mask on the ACM and either pilot''s DAP and:', 'Press the emergency button on the ACM''s digital audio panel.', 'Use the test/reset switch on the ACM''s oxygen mask.', 'Look for the yellow blinker to illuminate.', 'Turn the regulator knob to the emergency position and listen for the flow of oxygen.', 'd'),
(127, 236, 'nc', 'oxy', 'The ACM oxygen mask storage unit:', 'Has only a test button.', 'Is identical to the CA & FO.', 'Has only a visible test flow blinker.', 'None of the above.', 'd'),
(127, 247, 'mc', 'pneum', 'Wen will the crossbleed valve open automatically when in the "AUTO" position?', 'During ice test A.', 'During a cross-bleed start.', 'When the override knob on the ice protection panel is in ENG.', 'All of the above.', 'b'),
(127, 246, 'ac', 'pneum', 'During a bleed leak.', 'Hot bleed air is escaping from the bleed lines.', 'The engine bleed valve should automatically close.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd'),
(127, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(127, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'The APU bleed valve closes.', 'The engine bleed valve closes.', 'Both valves close.', 'Both valves can be open at the same time.', 'a'),
(127, 24, 'ac', 'powerplant', 'The engine has:', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', '6 stages of CVG vanes.', 'All of the above.', 'd'),
(127, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '800 C.', '868 C.', '506 C.', '901 C.', 'a'),
(127, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'Fuel pressure.', 'Engine oil pressure.', 'PMA.', '9th stage bleed air.', 'a'),
(127, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The PMA only.', 'The essential buses during an electrical emergency.', 'The essential buses.', 'The essential buses or the PMA depending on N2 RPM.', 'd'),
(127, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd'),
(127, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 2 and 3.', 'The static/pressurization ports.', 'Pitot/static tube 3.', 'All of the above.', 'c'),
(127, 281, 'mc', 'stall_prot', 'When your airspeed is in the amber part of the low speed awareness scale, what color is the PLI?', 'Amber.', 'White', 'Red.', 'All of the above.', 'c'),
(127, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, twist to Emergency.', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'd'),
(127, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'LAV SMOKE', 'All of the above.', 'a'),
(127, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'The engine bleed valves must be open.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'b'),
(128, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(128, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air entering the pack is too hot.', 'None of the above.', 'a'),
(128, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '89 feet in length.', '160 % of the length of an EMB-135.', '98 feet in length.', '110 feet in length.', 'c'),
(128, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '40 C', '-20 C', '54 C', '70 C', 'b'),
(128, 17, 'c2', 'apu', 'The APU can be started using:', 'Battery 2.', 'The GPU (with batteries in AUTO)', 'Battery 1.', 'A and B are correct.', 'd'),
(128, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'FMS', 'HDG', 'HDG, then FMS.', 'NAV', 'd'),
(128, 36, 'mc', 'autopilot', 'At what altitude must the autopilot be disengaged on a CAT I ILS approach?', '1500'' AGL.', '1000'' AGL.', '200'' AGL.', '500'' AGL.', 'c'),
(128, 37, 'mc', 'autopilot', 'What is the minimum engagement height for the autopilot (feet)?', '500', '200', '1000', '800', 'a'),
(128, 54, 'mc', 'autopilot', 'The FMA displays what messages after pressing the TOGA buttons on the ground?', 'HDG/TO', 'ROL/TO', 'ROL/VS', 'ROL/GA', 'b'),
(128, 42, 'c2', 'autopilot', 'Which of these are vertical flight guidance modes?', 'ROL', 'PIT', 'FLC', 'B and C are correct.', 'd'),
(128, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'Aft aircraft systems information is unavailable.', 'Engine #1 indications are replaced with amber dashes', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'b'),
(128, 7, 'mc', 'crew_awareness', 'If AHRS 1 or 2 fails:', 'The cross-side AHRS automatically takes over.', 'ATT FAIL appears on the EADI on the PFD.', 'Deselect pitot heat 3 to preserve battery life for the remaining component', 'None of the above.', 'b'),
(128, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By turning on the navigation lights.', 'By a 5G impact or immersion in water.', 'As soon as the electrical system is powered.', 'By turning on the red beacon.', 'c'),
(128, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'The standby airspeed indicator becomes unreliable.', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'B and C are correct.', 'd'),
(128, 85, 'mc', 'crew_awareness', 'How do the 5 cockpit CRTs appear following the loss of DC Bus 2?', 'Red X on MFD 2. MFD 1 and PFD 2 are blank.', 'PFD 2 and MFD 2 are blank.', 'Red X on PFD 1, MFD 2 and EICAS.', 'Red X on PFD 2 and MFD 2.  PFD 1 is blank.', 'a'),
(128, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Fuel and baggage doors.', 'Main cabin door only.', 'Over-wing emergency exit.', 'a'),
(128, 63, 'tf', 'crew_awareness', 'COM 3 cannot be used for voice communication when the EMER button is pushed in (selected) on the digital audio panel.', 'TRUE', 'FALSE', '', '', 'a'),
(128, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'Check your heading, you''re drifting from the assigned heading.', 'The FMS is suggesting heading select navigation.', 'A difference of 6 degrees between the left and right AHRS headings.', 'The heading system has failed.', 'c'),
(128, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(128, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is automatically displayed on RMU 1', 'Can be presented by using SG reversion.', 'Can be presented by using MFD reversion.', 'Is powered normally.', 'd'),
(128, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'That the GPU is plugged in with some power available.', 'The ground power unit is disconnected from the aircraft.', 'The ground air supply is supplying bleed air to the packs.', 'The aircraft electrical system is powered.', 'a'),
(128, 90, 'tf', 'elec', 'The ground service bus is not powered when the GPU is selected.', 'TRUE', 'FALSE', '', '', 'a'),
(128, 91, 'tf', 'elec', 'The electrical system splits into 2 independent electrical networks when there are 4 or more generators on-line.', 'TRUE', 'FALSE', '', '', 'a'),
(128, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(128, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Pressurization.', 'Normal gear extension.', 'Roll trim.', 'Flaps.', 'b'),
(128, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You are in essential power configuration but should not be.', 'Is normal during a loss of all generators.', 'You are not in the essential power configuration but should be.', 'None of the above.', 'c'),
(128, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'Weather Radar.', 'TCAS.', 'EGPWS/Wind Shear.', 'B and C are correct.', 'd'),
