(128, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered except the shed buses.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered.', 'Only the esential buses can be powered.', 'a'),
(128, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'All electrical busses except the shed busses.', 'The entire electrical system.', 'The hot battery busses, essential busses, and the central DC bus.', 'DC bus 1 and DC bus 2', 'c'),
(128, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'd'),
(128, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'b'),
(128, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The LAV BOTTLE INOP EICAS warning appears.', 'The LAV SMOKE EICAS warning appears.', 'The flight attendant hears a warning horn.', 'None of the above.', 'd'),
(128, 109, 'mc', 'fire_prot', 'How many smoke goggles are in the cockpit?', '2', '0', '3', 'All of the above.', 'c'),
(128, 107, 'tf', 'fire_prot', 'APU fire detection and protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'b'),
(128, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Closes the APU fuel shutoff valve.', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'Discharges the APU fire bottle.', 'A and C are correct.', 'd'),
(128, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a'),
