(128, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '18 Degrees.', '22 Degrees.', '45 Degrees.', 'B and C are correct.', 'd'),
(128, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '9 Degrees.', '18 Degrees.', '22 Degrees.', 'A and B are correct.', 'd'),
(128, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Rudder.', 'Inboard spoilers while in flight.', 'Ailerons.', 'Elevator', 'd'),
(128, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(128, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'd'),
(128, 136, 'mc', 'fuel', 'Which procedure is correct for balancing fuel between the left & right wing tanks?', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'b'),
(128, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The ACOC.', 'Each fuel tank.', 'The FCOC.', 'The left fuel tank.', 'd'),
