(128, 143, 'mc', 'hydraulics', 'With a complete failure of both hydraulic systems:', 'The landing extends normally.', 'The flaps operate normally.', 'The landing gear retracts normally.', 'The flaps will not extend.', 'b'),
(128, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'EICAS.', 'MFD ECS/AI page.', 'The RMU Engine page 1.', 'None of the above.', 'd'),
(128, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump does not operate unless the ON position is selected.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'A and C are correct.', 'd'),
(128, 144, 'mc', 'hydraulics', 'During normal flight, the engine drive hydraulic pump supplies:', '1600 psi.', '2900 psi.', '3000 psi.', '1200 psi.', 'c'),
(128, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '3000 psi.', '2900 psi.', '1600 psi.', '0 psi.', 'd'),
(128, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Fails closed (OFF) in essential power.', 'Cannot be activated unless ice is detected.', 'Uses bleed air from the 9th stage of the compressor.', 'None of the above.', 'd'),
(128, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is on and cannot be turned off.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is not available.', 'Is available with the override switch in ALL.', 'c'),
(128, 164, 'mc', 'ice_rain_prot', 'For ice protection to be activated automatically:', 'Both ice detectors must be working and detecting ice.', 'The TAT must be less than 10 C.', 'One or both ice detectos must be detecting ice.', 'The TAT must be less than 0 C.', 'c'),
(128, 169, 'mc', 'ice_rain_prot', 'When taxiing in icing conditions:', 'The APU bleed cannot be used becuase it is not hot enough for engine anti-ice.', 'The APU bleed can be used but only for a single engine taxi, since it is on the left side of the system.', 'The engines bleeds must be open for anti-ice.', 'The APU bleed air can be used for air conditioning.', 'd'),
(128, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever visible moisture is present.', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'Whenever the temperature is 10 C or less.', 'All of the above.', 'b'),
(128, 182, 'mc', 'ldg_gear_brk', 'The emergency brake provides:', 'Locked wheel protection, but not touchdown protection.', 'No anti-skid protection.', 'Anti-skid protection only.', 'None of the above.', 'b'),
(128, 193, 'mc', 'ldg_gear_brk', 'What is available when down to essential power?', 'Normal braking.', 'Spoilers.', 'Flaps.', 'TBCH.', 'a'),
(128, 176, 'mc', 'ldg_gear_brk', 'The emergency brake lines supply:', 'All 4 brakes.', 'The outboard brakes only.', 'The inboard brakes only.', 'All of the above.', 'a'),
(128, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'ARM position.', 'OFF position.', 'ON position.', 'None of the above.', 'a'),
(128, 195, 'tf', 'lighting', 'With the taxi light switch ON and the gear up and locked, the taxi lights are actually OFF.', 'TRUE', 'FALSE', '', '', 'a'),
(128, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '200 knots.', '250 knots.', '240 knots.', '180 knots.', 'a'),
(128, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '40 degrees C.', '20 degrees F.', '40 degrees F.', '20 degrees C.', 'a'),
