(128, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes, provided the flight crew advises ATC.', 'Yes.', 'Only if the crossfeed is on.', 'No.', 'b'),
(128, 207, 'mc', 'limitations', 'While descending through 10,000 ft, you notice the LP spool vibration on engine 1 is in the amber.  How long may it remain in the Amber?', '5 minutes.', '1 minute.', '90 seconds', '10 seconds.', 'd'),
(128, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '100 lbs.', '800 lbs.', 'No maximum exists provided the roll trim is operative.', '900 lbs.', 'b'),
(128, 222, 'mc', 'limitations', 'On the takeoff roll, oil pressure reaches 118 PSI. The correct action is to ...', 'Disregard - this is a normal oil pressure on takeoff.', 'Continue takeoff and start your timer.  Youa re time limited to 2 minutes.', 'Abort the takeoff if below 80 knots.', 'None of the above.', 'b'),
(128, 211, 'mc', 'limitations', 'The maximum tailwind component for takeoff and landing is ___.', '20 knots.', '10 knots.', '15 knots.', '30 knots.', 'b'),
(128, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-65.', '-40.', '-20.', '20.', 'b'),
(128, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-65 C.', '-52 C.', '-30 C.', '-45 C with momentary deviations to -50 C permitted.', 'd'),
