(128, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'OPEN, open.', 'AUTO, closed.', 'CLOSED, closed.', 'AUTO, open.', 'b'),
(128, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds closed, APU bleed open, PACKs on.', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'd'),
(128, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'When the override knob on the ice protection panel is in ENG.', 'During a cross-bleed start.', 'During ice test A.', 'None of the above.', 'b'),
(128, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Low power settings.', 'Cross-bleed starts.', 'External air starts.', 'Ice test A.', 'c'),
(128, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves can be open at the same time.', 'The APU bleed valve closes.', 'The engine bleed valve closes.', 'Both valves close.', 'b'),
(128, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'No line, no open inscription.', 'A line and an OPEN inscription.', 'A line, no OPEN inscription.', 'Open inscription, no line.', 'c'),
(128, 263, 'mc', 'powerplant', 'Regarding the powerplant, what actuates the CVG''s?', 'PMA.', '9th stage bleed air.', 'Engine oil pressure.', 'Fuel pressure.', 'd'),
(128, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a'),
(128, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'The engines shuts down.', 'Engine page 1 automatically appears on RMU1.', 'The engine reverts to N1SYN mode.', 'FADEC "A" automatically takes over.', 'd'),
(128, 255, 'mc', 'powerplant', 'The A1/E engines are limited to ___ ITT.', '948 C.', '901 continuous.', '880 for starting.', '992 C for 90 seconds and up to 970 C for 5 minutes.', 'd'),
(128, 259, 'mc', 'powerplant', 'What drives the items on the Engine Accessory Gearbox?', 'N2 via a linkage on the HP spool.', 'N2 via the tower shaft.', 'Reduction gears via the N1 turbine.', 'None of the above.', 'b'),
(128, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine runs in idle until the pilot resets the FADEC.', 'The engine shuts down.', 'The other FADEC (same engine) immediately takes over.', 'None of the above.', 'c'),
(128, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The PMA only.', 'The essential buses.', 'The essential buses during an electrical emergency.', 'The essential buses or the PMA depending on N2 RPM.', 'd'),
(128, 266, 'mc', 'powerplant', 'Which is not a pilot selectable thrust setting for the A1E engine?', 'TO-1.', 'ALT-TO.', 'TO-RSV.', 'E-TO.', 'c'),
(128, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'ALT TO TO, TO RSV, ETO RSV.', 'TO, ETO, TO RSV.', 'ETO, TO RSV, ETO RSV.', 'ALT TO, TO, ETO.', 'd'),
(128, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Provide static information to the CPAM.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'Provide static information to the ADCs.', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'd'),
(128, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately after the PACKs are selected during the after takeoff flow.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'All of the above.', 'a'),
(128, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 1 and 4.', 'The static/pressurization ports.', 'Pitot/static tube 3.', 'Static ports 2 and 3.', 'c'),
(128, 276, 'mc', 'profiles', 'During takeoff, if an engine fire is indicated after V1:', 'Continue the takeoff and perform the engine fire QRH after reaching a safe altitude.', 'Continue the takeoff and perform the engine fire QRH after reaching V2.', 'The takeoff should be aborted if sufficient runway remains.', 'Perform the engine fire QRH at acceleration height after reaching Vfs.', 'a'),
(128, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'Increasing gain increases receiver sensitivity.', 'The radar cannot be used on the ground.', 'GMAP mode is only available during ground operations.', 'Increasing gain increases the energy output from the antenna.', 'a'),
(128, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'At 130 KIAS.', 'A and B are correct.', 'd'),
(128, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'All of the above.', 'c'),
(128, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'LAV SMOKE', 'a'),
(128, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine bleed valves must be open.', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'a'),
(128, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'The crew must ensure that no passengers are on board.', 'Select "Mask" on the DAP, twist to Emergency.', 'a'),
(128, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'd'),
(128, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'd'),
(129, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The air entering the pack is too hot.', 'The pressure of air entering the pack is too high.', 'A and C are correct.', 'd'),
(129, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Only pack 1 turns off.', 'Both packs turn off.', 'Only pack 2 turns off.', 'All of the above.', 'b'),
(129, 30, 'mc', 'acft_gen', 'An EMB-145 XR is approximately...', '110 feet in length.', '89 feet in length.', '98 feet in length.', '160 % of the length of an EMB-135.', 'c'),
(129, 34, 'mc', 'apu', 'The proper way to shut down the APU is to:', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'Turn the master knob to OFF.', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'All of the above.', 'c'),
(129, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '54 C', '40 C', '-20 C', '70 C', 'c'),
(129, 39, 'mc', 'autopilot', 'When pressing the TOGA buttons on the ground while taxiing:', 'The flight director shows a 10 degree pitch up indication for takeoff.', 'GA mode is activated on the flight director.', 'The thrust rating changes to full thrust.', 'TO mode is activated on the flight director.', 'd'),
(129, 47, 'mc', 'autopilot', 'What vertical speed does FLC give you in a descent above 12,000 feet?', '3,000 feet per minute.', '2,000 feet per minute.', '3 degree glidepath.', '1,000 feet per minute.', 'b'),
(129, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'NAV', 'HDG, then FMS.', 'FMS', 'HDG', 'a'),
(129, 55, 'mc', 'autopilot', 'What button on the Display Control Panel would you push to allow navigation using the FMS?', 'LNAV', 'TTG', 'FMS', 'All of the above.', 'c'),
(129, 51, 'ac', 'autopilot', 'Which of the following will disconnect the autopilot?', 'The "AP" button on the Flight Guidance Control Panel', 'The quick disconnect button', 'Use of pitch trim', 'All of the above.', 'd'),
(129, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'As soon as the electrical system is powered.', 'By a 5G impact or immersion in water.', 'By turning on the navigation lights.', 'By turning on the red beacon.', 'a'),
(129, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on, regardless of the emergency light switch position in the cockpit.', 'TRUE', 'FALSE', '', '', 'a'),
(129, 65, 'mc', 'crew_awareness', 'If the EICAS screen fails, the EICAS information immediately appears on:', 'RMU 1.', 'It doesn''t appear anywhere immediately.', 'TBCH.', 'None of the above.', 'b'),
(129, 6, 'mc', 'crew_awareness', 'What happens if DAU 1A Fails?', 'Aft aircraft systems information is unavailable.', 'Engine #1 indications are replaced with amber dashes', 'The FADEC syncs N2 to N1.', 'DAU 1B automatically takes over.', 'b'),
(129, 59, 'tf', 'crew_awareness', 'The TBCH is the only means of tuning NAV2 in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(129, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'The standby airspeed indicator becomes unreliable.', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'B and C are correct.', 'd'),
(129, 76, 'mc', 'crew_awareness', 'The ELT battery:', 'Is charged by the shed buses', 'Is charged by the esential busses', 'Is not charged.', 'Is charged only when the ELT switch is in the ARM position.', 'c'),
(129, 66, 'mc', 'crew_awareness', 'An amber IAS flag on the PFD indicates:', 'Airspeed input from PITOT 3 differs by more than 5 knots from CA or FO indications.', 'CA and FO indicated airspeeds differ by more than 5 knots.', 'Approaching maximum airspeed (redline).', 'None of the above.', 'b'),
(129, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'Both aural channels have failed.', 'The digital audio panel is inoperative.', 'DAU2B has failed.', 'None of the above.', 'a'),
(129, 60, 'mc', 'crew_awareness', 'The emergency button on the digital audio panel:', 'Commands the TBCH to operate in the emergency mode.', 'Illuminates the EMER button on the flight attendant interphone.', 'Automatically switches to VHF 1 to 121.50.', 'Connect the captain only to COM 1 and NAV 1 and FO to COM 2 and NAV 2.', 'd'),
(129, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The AHRS to prevent loss of alignment data.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and FADECs.', 'c'),
(129, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered except the shed buses.', 'Only the esential buses can be powered.', 'All DC buses are powered if the shed bus knob is in OVRD.', 'All DC buses are powered.', 'a'),
(129, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Five, 24 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Four, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'b'),
(129, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'VOR-DME approaches can be flown using the standby instruments.', 'VOR (no DME) can be flown using the RMU navigation page', 'd'),
(129, 11, 'mc', 'elec', 'While on essential power, what busses are powered?', 'The hot battery busses, essential busses, and the central DC bus.', 'DC bus 1 and DC bus 2', 'All electrical busses except the shed busses.', 'The entire electrical system.', 'a'),
(129, 91, 'tf', 'elec', 'With 4 generators on-line, the electrical system operates as two separate systems.', 'TRUE', 'FALSE', '', '', 'a'),
(129, 90, 'tf', 'elec', 'The ground service bus is only powered with an available GPU NOT selected and the batteries OFF.', 'TRUE', 'FALSE', '', '', 'a'),
(129, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Flaps.', 'Roll trim.', 'Pressurization.', 'Normal gear extension.', 'd'),
(129, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '25 minutes.', '20 minutes.', '15 minutes.', '40 minutes.', 'd'),
(129, 13, 'mc', 'elec', 'What items are available in essential power?', 'FMS, PFD and MFDs.', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS1, DAU1B, DAU2B', 'SG2, DAU2B', 'b'),
(129, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'a'),
(129, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'b'),
(129, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'All of the above.', 'd'),
(129, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(129, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'The engine bleed and lip anti-ice ice valves.', 'The fuel shutoff valve.', 'All of the above.', 'd'),
(129, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'Fire extinguishing handle - PULL & ROTATE.', 'Start/Stop Selector - STOP.', 'Thrust lever - IDLE.', 'd'),
(129, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a'),
(129, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'Hydraulic system 1 & 2.', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'DC bus 1 & 2.', 'Essential buses.', 'c'),
(129, 119, 'mc', 'flt_control', 'The gust lock prevents the movement of the:', 'Inboard spoilers while in flight.', 'Elevator', 'Ailerons.', 'Rudder.', 'b'),
(129, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'A low TLA (thrust lever angle).', 'The speedbrake lever has to be selected to OPEN.', 'The flap lever has to be at 0 or 9 degrees.', 'All of the above.', 'd'),
(129, 132, 'mc', 'flt_control', 'The EICAS message "FLAP LOW SPEED"...', 'Indicates a mis-threading of the ball-screw actuator.', 'Indicates a flap motor failure.', 'Indicates a failure of the teleflex cable.', 'Indicates a failure of the flap velocity sensor.', 'b'),
(129, 136, 'mc', 'fuel', 'To balance fuel:', 'Turn the pump in the low tank off.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'Turn the crossfeed knob to LOW 1 if tank 1 has more fuel.', 'None of the above.', 'b'),
(129, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'De-energizing the boost pumps in tank 2.', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 1.', 'None of the above.', 'c'),
(129, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The left fuel tank.', 'The FCOC.', 'The ACOC.', 'All of the above.', 'a'),
(129, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the XR is ___ lbs.', '100.', '800.', '1000.', '365.', 'b'),
(129, 141, 'tf', 'fuel', 'Fuel crossfeed is not available in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(129, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Places the electric hydraulic pump in a standby condition.', 'Turns on the electric pump regardless of system pressure.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'All of the above.', 'b'),
(129, 145, 'mc', 'hydraulics', 'The hydraulic accumulator #2 alone can supply the:', 'Inboard spoilers, outboard brakes, landing gear.', 'Emergency brakes only, unlimited applications.', 'Outboard spoilers, inboard brakes, emergency brakes.', 'Emergency brakes only, supplying 6 applications.', 'd'),
(129, 155, 'mc', 'hydraulics', 'In essential power, the electric hydraulic pumps are:', 'Not available.', 'Both available.', 'Only the #1 pump is available for landing gear extension.', 'All of the above.', 'a'),
(129, 151, 'mc', 'hydraulics', 'Hydraulic system 1 provides pressure to:', 'The nose-wheel steering.', 'The inboard flaps.', 'The rudder above 135 KIAS.', 'The parking brake.', 'a'),
(129, 154, 'nc', 'hydraulics', 'The hydraulic accumulator #1 provides pressure for:', 'Nosewheel steering.', 'Emergency brakes.', 'Ailerons and rudder should all pressure be lost.', 'None of the above.', 'd'),
(129, 174, 'mc', 'ice_rain_prot', 'Which statement is true regarding the operation of the clear ice detection on an XRJ?', 'In flight only, when clear ice is present on the wing.', 'On the ground or in flight when clear ice is present on the wing.', 'On the ground only, when clear ice is present on the wing.', 'All of the above.', 'c'),
(129, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The engine bleeds should be selected open.', 'The use of packs is only permitted if the APU bleed is available.', 'Pack 1 is off, Pack 2 is on.', 'None of the above.', 'a'),
(129, 167, 'mc', 'ice_rain_prot', 'In essential power, wing and stabilizer anti-ice:', 'Is available with the override switch in ALL.', 'Wing and stabilizer anti-ice will operate, but expect failure messages.', 'Is on and cannot be turned off.', 'Is not available.', 'd'),
(129, 173, 'mc', 'ice_rain_prot', 'The horizontal stabilizer and wing anti-ice subsystems are automatically inhibited:', 'With the FADEC Ref. anti-ice selected OFF.', 'They are never inhbited.', 'On the ground with a wheel speed at or below 25 kts.', 'None of the above.', 'c'),
(129, 166, 'mc', 'ice_rain_prot', 'In essential power, engine anti-ice is:', 'Available if selected on or in icing conditions.', 'Comes from the 9th stage of the compressor only.', 'On and cannot be turned off.', 'None of the above.', 'c'),
(129, 176, 'mc', 'ldg_gear_brk', 'The emergency brake lines supply:', 'All 6 brakes.', 'All 4 brakes.', 'The outboard brakes only.', 'The inboard brakes only.', 'b'),
(129, 188, 'mc', 'ldg_gear_brk', 'Nosewheel tire rotation is stopped on retraction by:', 'Pneumatic pressure.', 'Mechanical snubber.', 'Hydraulic pressure.', 'Normal spin down.', 'b'),
(129, 180, 'tf', 'ldg_gear_brk', 'When using the emergency brakes, the anti-skid, locked wheel and touchdown protection are not available.', 'TRUE', 'FALSE', '', '', 'a'),
(129, 197, 'mc', 'lighting', 'The emergency lights will last a minimum of:', '15 minutes.', '30 minutes.', '40 minutes.', '45 minutes if pitot 3 heat is turned off.', 'a'),
(129, 198, 'mc', 'lighting', 'The courtesy lights:', 'Knob must be left in the AUTO position.', 'Could deplete battery 2 unless turned OFF.', 'Come on automatically when normal power is lost.', 'Automatically shut off when the airplane is depowered.', 'b'),
(129, 215, 'mc', 'limitations', 'What is VLE?', '180 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '200 knots.', '250 knots.', 'd'),
(129, 209, 'mc', 'limitations', 'What is the first step in the PITCH TRIM RUNAWAY memory item?', 'Control column hold firmly.', 'Pitch systems 1 & 2 off.', 'Quick disconnect button, press and hold.', 'Actuate the pitch trim switch in the opposite direction.', 'a'),
(129, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '20.', '-65.', '-40.', '-20.', 'c'),
(129, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL350.', 'FL450.', 'FL 370.', 'd'),
(129, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '-65 C.', '9 C.', '35 C.', '-21.5 C.', 'd'),
(129, 287, 'mc', 'limitations', 'Can an engine start be allowed to continue if the oil pressure is in the amber range?', 'No - this is an abnormal condition and the start should be aborted regardless of temperature.', 'Yes - oil pressure limitations only apply during the takeoff phase.', 'Yes - if the ITT is more than 600 C.', 'Yes - if the oil temperature is less than 21 C.', 'd'),
(129, 214, 'mc', 'limitations', 'The total air temperature (TAT) in cruise flight above FL250 is limited to ___.', '-45 C with momentary deviations to -50 C permitted.', '-52 C.', '-65 C.', '-30 C.', 'a'),
(129, 208, 'mc', 'limitations', 'What is the minimum oil temperature required to increase N2 above 83%?', '20 degrees F.', '40 degrees F.', '20 degrees C.', '40 degrees C.', 'd'),
(129, 212, 'mc', 'limitations', 'The maximum static air temperature (SAT) for aircraft operation is ___.', 'ISA + 25 C.', 'ISA + 45 C.', 'ISA + 15 C.', 'ISA + 35 C.', 'd'),
(129, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS below 10,000 feet.', '250 KIAS or MACH .63, whichever is lower.', '200 KIAS.', '250 KIAS or MACH .63, whichever is higher.', 'c'),
(129, 227, 'mc', 'oxy', 'The passenger oxygen system includes:', 'Demand flow masks.', '50 inflatable harness masks.', 'Two oxygen bottles, which supply the passenger oxygen masks.', 'Oxygen generators.', 'd'),
(129, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,500'' +/- 500 cabin altitude.', '10,000'' cabin altitude.', '14,000'' MSL.', '14,000'' AGL.', 'a'),
(129, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'b'),
(129, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, closed.', 'AUTO, open.', 'OPEN, open.', 'CLOSED, closed.', 'a'),
(129, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Low power settings.', 'Ice test A.', 'External air starts.', 'Cross-bleed starts.', 'c'),
(129, 241, 'mc', 'pneum', 'With the APU off and the APU bleed button selected OPEN, the button has:', 'A line, no OPEN inscription.', 'Open inscription, no line.', 'No line, no open inscription.', 'A line and an OPEN inscription.', 'a'),
(129, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
(129, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'During ice test A.', 'Anytime the ICE CONDITION EICAS message is displayed.', 'During a cross-bleed start.', 'None of the above.', 'c'),
(129, 24, 'ac', 'powerplant', 'The engine has:', '6 stages of CVG vanes.', 'A 14 stage compressor.', 'A 2 stage high-pressure turbine.', 'All of the above.', 'd'),
(129, 260, 'mc', 'powerplant', 'Engine FADECs are powered by...', 'The PMA only.', 'The essential buses during an electrical emergency.', 'The essential buses or the PMA depending on N2 RPM.', 'The essential buses.', 'c'),
(129, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'RMU maintenance page.', 'EICAS.', 'MFD takeoff page.', 'None of the above.', 'c'),
(129, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Fails and the other FADEC takes over.', 'Automatically shuts down the engine.', 'Presents the FADEC NO DISP EICAS.', 'All of the above.', 'b'),
(129, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a'),
(129, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'ETO, TO RSV, ETO RSV.', 'TO, ETO, TO RSV.', 'ALT TO, TO, ETO.', 'ALT TO TO, TO RSV, ETO RSV.', 'c'),
(129, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'FADEC "A" automatically takes over.', 'The engines shuts down.', 'The engine reverts to N1SYN mode.', 'All of the above.', 'a'),
(129, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'The thrust reverser stows automatically.', 'The FADEC reduces the thrust to idle automatically.', 'There is no automatic reaction.', 'The engine shuts down automatically.', 'b'),
(129, 258, 'mc', 'powerplant', 'The engine must run at idle or taxi thrust for a minimum of ___ before shutdown.', '5 minutes.', '1 minute.', '2 minutes.', 'None of the above.', 'c'),
(129, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Static ports 2 and 3.', 'Static ports 1 and 4.', 'Pitot/static tube 3.', 'None of the above.', 'c'),
(129, 268, 'mc', 'pressurization', 'Which altitude needs to be set by the pilot in the automatic pressurization system?', 'Landing elevation.', 'Desired cabin altitude.', 'Cruise altitude.', 'None of the above.', 'a'),
(129, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '1700'' AGL.', '25,000''.', '14,000'' +/- 500''.', '24,600''.', 'b'),
(129, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Vfs.', 'Positive rate of climb.', 'Above a safe altitude.', 'Reaching acceleration height and then a speed of V2 + 15.', 'd'),
(129, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'Increasing gain increases receiver sensitivity.', 'GMAP mode is only available during ground operations.', 'Increasing gain increases the energy output from the antenna.', 'The radar cannot be used on the ground.', 'a'),
(129, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'During an SPS test.', 'If one channel of the SPS is inoperative.', 'If the SPS/ICE SPEEDs message is displayed.', 'None of the above.', 'b'),
(129, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'At 130 KIAS.', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'B and C are correct.', 'd'),
(129, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'c'),
(129, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'All three bleed valves must be closed.', 'c'),
(129, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'LAV SMOKE', 'a');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
