(131, 4, 'mc', 'crew_awareness', 'Which event is specific to a symbol generator 1 failure?', 'RMU 1 automatically displays Engine Page 1', 'Symbol generator 2 automatically supplies symbols to all 5 screens.', 'PFD1 and MFD1 go blank.', 'All of the above.', 'a'),
(131, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Five, 28 Volt DC generators.', 'Five, 24 Volt DC generators.', 'Four, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'a'),
(131, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You are in essential power configuration but should not be.', 'You have one electrical system despite having 4 or more generators on-line.', 'Is normal during a loss of all generators.', 'You are not in the essential power configuration but should be.', 'd'),
(131, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'DC bus 2.', 'Backup hot bus.', 'Essential bus 2.', 'Central DC bus.', 'b'),
(131, 95, 'mc', 'elec', 'The following is available if down to essential power.', 'Pressurization.', 'Flaps.', 'Normal gear extension.', 'All of the above.', 'c'),
(131, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR-DME approaches can be flown using the standby instruments.', 'VOR (no DME) can be flown using the RMU navigation page', 'VOR approaches are impossible since the PFD is blank.', 'c'),
(131, 90, 'tf', 'elec', 'The ground service bus is only powered with an available GPU NOT selected and the batteries OFF.', 'TRUE', 'FALSE', '', '', 'a'),
(131, 92, 'c2', 'elec', 'The shed buses are powered:', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'A and C are correct.', 'd'),
(131, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'TCAS.', 'Weather Radar.', 'EGPWS/Wind Shear.', 'A and C are correct.', 'd'),
(131, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The aircraft electrical system is powered.', 'The ground air supply is supplying bleed air to the packs.', 'That the GPU is plugged in with some power available.', 'None of the above.', 'c'),
(131, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered if the shed bus knob is in OVRD.', 'Only the esential buses can be powered.', 'All DC buses are powered except the shed buses.', 'All of the above.', 'c'),
(131, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', 'b'),
(131, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'c'),
(131, 105, 'mc', 'fire_prot', 'What is the first immediate action item (memory item) for an engine fire in flight?', 'Fire extinguishing handle - PULL, DO NOT ROTATE.', 'Fire extinguishing handle - PULL & ROTATE.', 'Start/Stop Selector - STOP.', 'Thrust lever - IDLE.', 'd'),
(131, 108, 'tf', 'fire_prot', 'Engine fire protection is available when the aircraft is de-powered.', 'TRUE', 'FALSE', '', '', 'a'),
(131, 114, 'ac', 'fire_prot', 'Select the true statement regarding fire protection:', 'APU fire detection and protection is available in essential power.', 'Low pressure in the fire loop will trigger a FIRE DET FAIL caution message.', 'High pressure in the fire loop will trigger a FIRE warning message.', 'All of the above.', 'd'),
(131, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'B and C are correct.', 'd'),
(131, 125, 'ac', 'flt_control', 'The requirements for the speedbrakes to be open are:', 'The flap lever has to be at 0 or 9 degrees.', 'The speedbrake lever has to be selected to OPEN.', 'A low TLA (thrust lever angle).', 'All of the above.', 'd'),
(131, 120, 'tf', 'flt_control', 'When in manual reversion, the elevators, ailerons and rudder can all be actuated mechanically.', 'TRUE', 'FALSE', '', '', 'a'),
(131, 127, 'mc', 'flt_control', 'Ailerons are positioned utilizing:', 'Offside hydraulic pressure only.', 'Both hydraulic systems.', 'Mechanical Means.', 'Onside hydraulic pressure only.', 'b'),
(131, 124, 'tf', 'flt_control', 'The ground spoilers open when the airplane is on the ground, wheel speed >25 kts and a low TLA.', 'TRUE', 'FALSE', '', '', 'a'),
(131, 126, 'mc', 'flt_control', 'The flaps are powered by:', 'DC bus 1 & 2.', 'Hydraulic system 1 & 2.', 'DC bus 1 & 2 under normal conditions; Essential buses in an electrical emergency.', 'Essential buses.', 'a'),
(131, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'a'),
(131, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(131, 134, 'mc', 'fuel', 'The maximum allowed fuel imbalance in the LR is ___ lbs.', '365.', '1000.', '800.', '100.', 'c'),
(131, 140, 'mc', 'fuel', 'In essential power:', 'No fuel boost pumps are available.', 'All fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'c'),
(131, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 1.', 'De-energizing the boost pumps in tank 2.', 'De-energizing the boost pumps in tank 1.', 'None of the above.', 'c'),
(131, 151, 'mc', 'hydraulics', 'Hydraulic system 1 provides pressure to:', 'The inboard flaps.', 'The parking brake.', 'The nose-wheel steering.', 'All of the above.', 'c'),
(131, 150, 'mc', 'hydraulics', 'The electric hydraulic pump control knob in the ON position:', 'Turns on the electric pump regardless of system pressure.', 'Turns on the electric pump only if the engine is shut down.', 'Turns on the electric hydraulic pump only if system pressure is lost.', 'None of the above.', 'a'),
(131, 156, 'mc', 'hydraulics', 'The ailerons are normally hydraulically powered by:', 'Hydraulic system 1 only.', 'Both hydraulic systems.', 'Hydraulic system 2 only, when above 135 KIAS.', 'All of the above.', 'b'),
(131, 148, 'c2', 'hydraulics', 'What does the AUTO position of the electric hydraulic pump knob provide?', 'The pump does not operate unless the ON position is selected.', 'The pump is kept in standby until the engine driven pump pressure drops below a set value.', 'The pump is kept in standby until the asociated engine N2 drops below a set value.', 'B and C are correct.', 'd'),
(131, 153, 'mc', 'hydraulics', 'Hydraulic system temperature can be monitored on the:', 'Cannot be monitored.', 'EICAS.', 'The MFD hydraulic page for system 1 only.', 'None of the above.', 'a'),
(131, 174, 'mc', 'ice_rain_prot', 'Which statement is true regarding the operation of the clear ice detection on an XRJ?', 'On the ground only, when clear ice is present on the wing.', 'In flight only, when clear ice is present on the wing.', 'XRJ''s are not equipped with clear ice detectors.', 'On the ground or in flight when clear ice is present on the wing.', 'a'),
(131, 171, 'mc', 'ice_rain_prot', 'Ice test A requires:', 'The override to ENG/test switch held for 20 seconds in each position.', 'Override to ALL, test switch for 10 seconds minimum.', 'Override to AUTO.', 'Override to AUTO for a minimum of 10 seconds, maximum 30 seconds.', 'b'),
(131, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'The XR has boots.', 'No ice test is needed.', 'There are clear ice-detectors on the wings.', 'd'),
(131, 172, 'c2', 'ice_rain_prot', 'Regarding ice protection, what aircraft components are heated electrically?', 'Ice detectors.', 'The leading edge of the wings and the horizontal stabilizer.', 'TAT probes.', 'A and C are correct.', 'd'),
(131, 162, 'nc', 'ice_rain_prot', 'Engine lip anti-ice:', 'Uses bleed air from the 9th stage of the compressor.', 'Fails closed (OFF) in essential power.', 'Cannot be activated unless ice is detected.', 'None of the above.', 'd'),
(131, 180, 'tf', 'ldg_gear_brk', 'When using the emergency brakes, the anti-skid, locked wheel and touchdown protection are not available.', 'TRUE', 'FALSE', '', '', 'a'),
(131, 193, 'mc', 'ldg_gear_brk', 'What is available when down to essential power?', 'Normal braking.', 'TBCH.', 'Flaps.', 'Spoilers.', 'a'),
(131, 184, 'mc', 'ldg_gear_brk', 'The landing gear freefall actuator, when pulled:', 'Bypasses the landing gear handle to extend the gear hydrualically.', 'Requires no electrical or hydrualic power to extend the landing gear.', 'Uses essential power to extend the gear.', 'None of the above.', 'b'),
(131, 202, 'mc', 'lighting', 'What is the power source for the nose landing light?', 'Backup bus.', 'Essential.', 'Shed.', 'All of the above.', 'c'),
(131, 200, 'mc', 'lighting', 'The emergency light batteries are charged with normal power established on the aircraft and when the emergency light switch is in the:', 'OFF position.', 'ARM position.', 'ON position.', 'Are not charged and replaced periodically by maintenance.', 'b'),
(131, 204, 'mc', 'limitations', 'The XR maximum operational altitude is:', 'FL410.', 'FL 370.', 'FL450.', 'FL350.', 'b'),
(131, 223, 'mc', 'limitations', 'Maneuvering speed (VA) is ...?', '250 KIAS or MACH .63, whichever is lower.', '250 KIAS or MACH .63, whichever is higher.', '250 KIAS below 10,000 feet.', '200 KIAS.', 'd'),
(131, 222, 'mc', 'limitations', 'On the takeoff roll, oil pressure reaches 118 PSI. The correct action is to ...', 'Abort the takeoff if below 80 knots.', 'Abort the takeoff if below V1.', 'Disregard - this is a normal oil pressure on takeoff.', 'Continue takeoff and start your timer.  Youa re time limited to 2 minutes.', 'd'),
(131, 205, 'mc', 'limitations', 'After completing the Emergency Descent memory item, below what airspeed must you retract the landing gear?', '180 knots.', '240 knots.', '250 knots.', '200 knots.', 'd'),
(131, 217, 'mc', 'limitations', 'What is the maximum airspeed after takeoff without re-trimming?', 'Our fleet is post-mod SB 10-02 and the limitation no longer applies.', '200 knots.', '170 knots.', '160 knots.', 'd'),
(131, 210, 'mc', 'limitations', 'What is the minimum oil temperature for engine start?', '-20 F.', '-40 F.', '-40 C.', '-20 C.', 'c'),
(131, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL300.', 'FL350.', 'FL200.', 'FL370.', 'a'),
(131, 215, 'mc', 'limitations', 'What is VLE?', '250 knots.', '200 knots.', '200 knots below 10,000 and 180 knots when above 10,000.', '180 knots.', 'a'),
(131, 203, 'mc', 'limitations', 'The minimum outside temperature (Celsius)  for takeoff is:', '-65.', '20.', '-40.', '-20.', 'c'),
(131, 206, 'mc', 'limitations', 'With a FUEL IMBALANCE EICAS message and a 750 lb. fuel imbalance, is it acceptable to takeoff.', 'Yes.', 'Yes, provided the flight crew advises ATC.', 'No.', 'Only if the crossfeed is on.', 'a'),
(131, 225, 'mc', 'oxy', 'The FASTEN SEAT BELT signs are automatically turned on:', 'Never.', 'In essential power.', 'When the oxygen ON indicator light is illuminated.', 'Upon pressing the CONFIRM INIT button on the FMS prior to pushback.', 'c'),
(131, 229, 'mc', 'oxy', 'Minimum dispatch pressure for the portable oxygen bottle is:', '400 PSI.', '1200 PSI.', '500 PSI.', '1850 PSI.', 'b'),
(131, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'The APU bleed valve closes.', 'Both valves can be open at the same time.', 'The engine bleed valve closes.', 'Both valves close.', 'a'),
(131, 247, 'mc', 'pneum', 'When will the crossbleed valve open automatically when in the "AUTO" position?', 'Anytime the ICE CONDITION EICAS message is displayed.', 'During a cross-bleed start.', 'During ice test A.', 'None of the above.', 'b'),
(131, 239, 'mc', 'pneum', 'For a summer takeoff in Houston with an MEL''d APU, the bleeds should be configured:', 'Engine bleeds open, APU bleed closed, PACKs off.', 'All bleeds open, PACKs on, cross bleed open.', 'Engine bleeds closed, APU bleed open, PACKs on.', 'Engine bleeds open, APU bleed closed, PACKs on, crossbleed open.', 'a'),
(131, 246, 'ac', 'pneum', 'During a bleed leak.', 'The engine bleed valve should automatically close.', 'Hot bleed air is escaping from the bleed lines.', 'A red "LEAK" inscription appears on the pneumatic panel.', 'All of the above.', 'd'),
(131, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(131, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Cross-bleed starts.', 'External air starts.', 'Low power settings.', 'Ice test A.', 'b'),
(131, 253, 'mc', 'powerplant', 'If the controlling FADEC fails.', 'The engine shuts down and may be restarted after alternating FADECs.', 'The other FADEC (same engine) immediately takes over.', 'The engine shuts down.', 'The engine runs in idle until the pilot resets the FADEC.', 'b'),
(131, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'ALT TO TO, TO RSV, ETO RSV.', 'ALT TO, TO, ETO.', 'TO, ETO, TO RSV.', 'ETO, TO RSV, ETO RSV.', 'b'),
(131, 265, 'mc', 'powerplant', 'Which is not an item in the engine''s accessory gear box?', 'Engine driven generator.', 'Ejector pump.', 'Oil pump.', 'Hydraulic pump.', 'b'),
(131, 255, 'mc', 'powerplant', 'The A1/E engines are limited to ___ ITT.', '880 for starting.', '948 C.', '992 C for 90 seconds and up to 970 C for 5 minutes.', '901 continuous.', 'c'),
(131, 264, 'mc', 'powerplant', 'If FADEC B fails when it is controlling Engine 2:', 'FADEC "A" automatically takes over.', 'The engine reverts to N1SYN mode.', 'The engines shuts down.', 'Engine page 1 automatically appears on RMU1.', 'a'),
(131, 254, 'tf', 'powerplant', 'Do not abort the takeoff if oil pressure increases from the green to the amber range:', 'TRUE', 'FALSE', '', '', 'a'),
(131, 260, 'mc', 'powerplant', 'The FADECs receive electrical power from:', 'The essential buses or the PMA depending on N2 RPM.', 'The essential buses during an electrical emergency.', 'The essential buses.', 'All of the above.', 'a'),
(131, 251, 'mc', 'powerplant', 'If both FADECs of one engine fail:', 'The engine keeps running but thrust cannot be changed.', 'The engine keeps running in N1 reversionary mode.', 'The engine shuts down.', 'All of the above.', 'c'),
(131, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD takeoff page.', 'MFD Hydraulic page.', 'EICAS.', 'All of the above.', 'a'),
(131, 274, 'c2', 'pressurization', 'The "Dump" button on the automatic pressurization controller:', 'Is not useable in manual pressurization mode.', 'Will depressurize up to FL370.', 'Depressurizes the cabin to a maximum of 14,500 ft.', 'A and C are correct.', 'd'),
(131, 270, 'mc', 'pressurization', 'The maximum altitude with one PACK inoperative is:', '24,600''.', '25,000''.', '1700'' AGL.', '14,000'' +/- 500''.', 'b'),
(131, 272, 'mc', 'pressurization', 'The CPAM receives its static air pressure from:', 'Pitot/static tube 3.', 'Static ports 2 and 3.', 'Static ports 1 and 4.', 'All of the above.', 'a'),
(131, 275, 'mc', 'profiles', 'During a go-around, the flaps can be raised to 0 degrees at:', 'Above a safe altitude.', 'Positive rate of climb.', 'Reaching acceleration height and then a speed of V2 + 15.', 'All of the above.', 'c'),
(131, 278, 'mc', 'radar', 'Regarding the weather radar, select the true statement.', 'The radar cannot be used on the ground.', 'Increasing gain increases the energy output from the antenna.', 'Increasing gain increases receiver sensitivity.', 'GMAP mode is only available during ground operations.', 'c'),
(131, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'At 130 KIAS.', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'B and C are correct.', 'd'),
(131, 279, 'mc', 'stall_prot', 'The stick pusher is inhibited:', 'During an SPS test.', 'If the SPS/ICE SPEEDs message is displayed.', 'If the airspeed is less than 200 kts.', 'If one channel of the SPS is inoperative.', 'd'),
(131, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine thrust must be at a minimum of 83% N1.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'None of the above.', 'c'),
(131, 237, 'mc', 'mandatory', 'In order to test the First Officer''s oxygen mask,', 'The crew must ensure that no passengers are on board.', 'Press the "test" button.  In this case it is not necessary to select "Mask."', 'Select "Mask" on the DAP, adjust speaker volume, and press test button.', 'None of the above.', 'c'),
(131, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to ON, 1600 psi.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'd'),
(131, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'Bleeds Open, Packs Open, Crossbleed ALL', 'a'),
(131, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'LAV SMOKE', 'APU Fire Loop Fail', 'E1(2) EXTBL A(B) INOP', 'BAGG SMOKE', 'd'),
(132, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the compressor is too hot.', 'The air leaving the pack is too hot.', 'The air entering the compressor is too hot.', 'The air entering the pack is too hot.', 'b'),
(132, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Only pack 2 turns off.', 'Both packs stay on.', 'Only pack 1 turns off.', 'a'),
(132, 29, 'mc', 'acft_gen', 'Which door, when open, will cause an "ACCESS DOORS OPN" EICAS message?', 'Forward nose hydraulic compartment.', 'Under cockpit access hatch.', 'Overwing emergency exit.', 'Baggage compartment door.', 'b'),
(132, 34, 'mc', 'apu', 'The proper way to shut down the APU is to:', 'Press the FUEL SHUTOFF button.', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'Turn the master knob to OFF.', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'd'),
(132, 33, 'mc', 'apu', 'An attempt to start the APU can be made if battery voltage is at least:', '23.5V', '19.0V', '24.0V', '20.0V', 'b'),
(132, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Display Control Panel', 'Flight Director button on the Flight Guidance Control Panel', 'Flight Mode Anunciator (FMA).', 'None of the above.', 'c'),
(132, 44, 'mc', 'autopilot', 'When selected, low bank is equal to ____ : ?', '13 degrees above FL250.', '27 degrees.', '14 degrees.', '10 degrees.', 'c'),
(132, 38, 'mc', 'autopilot', 'During climb, FLC works just like:', 'VS but with preset vertical speeds.', 'SPD with preset values below 10,000'' and VS with preset values above 10,000''.', 'PIT but with preset attitudes.', 'SPD but with preset speeds.', 'd'),
(132, 46, 'mc', 'autopilot', 'What button on the flight guidance control panel would you push to navigate using the FMS?', 'FMS', 'NAV', 'HDG, then FMS.', 'HDG', 'b'),
(132, 48, 'mc', 'autopilot', 'What pitch attitude does the aircraft hold in the go-around sub-mode for the first twenty seconds (airspeed > 1.23VS)?', '10 Degrees', '13 Degrees.', 'The aircraft does not hold a specific pitch attitude during the first 20 seconds of this sub-mode.', '14 degrees (once you are flaps 9).', 'a'),
(132, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(132, 3, 'mc', 'crew_awareness', 'Which parameter is not evaluated for a takeoff configuration check?', 'Parking brake set.', 'Flaps 0.', 'Pitch trim set to 0 degrees.', 'One or both engines not running.', 'd'),
(132, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main and service doors.', 'Over-wing emergency exit.', 'Fuel and baggage doors.', 'None of the above.', 'a'),
(132, 60, 'mc', 'crew_awareness', 'The emergency button on the digital audio panel:', 'Automatically switches to VHF 1 to 121.50.', 'Connect the captain only to COM 1 and NAV 1 and FO to COM 2 and NAV 2.', 'Commands the TBCH to operate in the emergency mode.', 'Illuminates the EMER button on the flight attendant interphone.', 'b'),
(132, 56, 'mc', 'crew_awareness', 'The cockpit voice recorder starts recording:', 'By a 5G impact or immersion in water.', 'As soon as the electrical system is powered.', 'By turning on the navigation lights.', 'By turning on the red beacon.', 'b'),
(132, 62, 'mc', 'crew_awareness', 'The EICAS caution AURAL WARN FAIL indicates:', 'The digital audio panel is inoperative.', 'DAU2B has failed.', 'Only one aural channel is working.', 'Both aural channels have failed.', 'd'),
(132, 58, 'tf', 'crew_awareness', 'The flight attendant can override the cockpit switch and turn the emergency lights on, regardless of the emergency light switch position in the cockpit.', 'TRUE', 'FALSE', '', '', 'a'),
(132, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot 1/Static ports 1 & 4.', 'Pitot 2/Static ports 2 & 3.', 'Pitot/Static tube 3', 'Pitot 1/Fadec pressurization static port.', 'c');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(132, 4, 'mc', 'crew_awareness', 'If symbol generator 1 fails:', 'PFD1 and MFD1 go blank.', 'The EICAS reversionary buttons must be pressed to activate channel B.', 'Symbol generator 2 automatically supplies symbols to all 5 screens.', 'RMU 1 automatically displays Engine Page 1', 'd'),
(132, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(132, 10, 'mc', 'elec', 'The GPU AVAIL inscription on the GPU button indicates:', 'The ground power unit is disconnected from the aircraft.', 'The aircraft electrical system is powered.', 'That the GPU is plugged in with some power available.', 'The ground air supply is supplying bleed air to the packs.', 'c'),
(132, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'You have one electrical system despite having 4 or more generators on-line.', 'You are not in the essential power configuration but should be.', 'You are in essential power configuration but should not be.', 'Is normal during a loss of all generators.', 'b'),
(132, 1, 'tf', 'elec', 'The emergency light system is powered from Essential DC Bus 2.', 'TRUE', 'FALSE', '', '', 'b'),
(132, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR approaches are impossible since the PFD is blank.', 'VOR (no DME) can be flown using the RMU navigation page', 'All of the above.', 'c'),
(132, 88, 'c2', 'elec', 'The items powered by the AC electrical system are:', 'Weather Radar.', 'TCAS.', 'EGPWS/Wind Shear.', 'B and C are correct.', 'd'),
(132, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are open.', 'BC 1 and BC 2 are closed.', 'The ALC is closed if the APU has been started.', 'All of the above.', 'a'),
(132, 96, 'mc', 'elec', 'On the ground with the main batteries as the only source of power:', 'All DC buses are powered.', 'All DC buses are powered except the shed buses.', 'Only the esential buses can be powered.', 'All of the above.', 'b'),
(132, 13, 'mc', 'elec', 'What items are available in essential power?', 'SG2, DAU2B', 'FMS, PFD and MFDs.', 'RMU1, RMU2, EICAS and standby instruments.', 'FMS1, DAU1B, DAU2B', 'c'),
(132, 93, 'mc', 'elec', 'Which electrical bus supplies power to the ISIS on the XR?', 'DC bus 2.', 'Backup hot bus.', 'Essential bus 2.', 'Central DC bus.', 'b'),
(132, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The AHRS to prevent loss of alignment data.', 'All of the above.', 'b'),
(132, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', 'c'),
(132, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'd'),
