(141, 233, 'mc', 'oxy', 'To ensure the main oxygen cylinder is in the "ON" position:', 'Turn the valve on the outside oxygen panel.', 'There is no valve.', 'Turn the valve in the flightdeck.', 'None of the above.', 'c'),
(141, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'Air after the compressor is too hot.', 'Air leaving the pre-cooler is too hot.', 'The air leaving the pack is too hot.', 'A massive leak detector has detected a bleed leak.', 'b'),
(141, 245, 'tf', 'pneum', 'While taxiing in ground icing conditions, the APU bleed may be used to supply air to the packs.', 'TRUE', 'FALSE', '', '', 'a'),
(141, 244, 'c2', 'pneum', 'Engine bleed air is used from:', 'The 9th compressor stage at higher thrust settings.', 'The 14th stage compressor only.', 'The 14th compressor stage in icing conditions.', 'A and C are correct.', 'd'),
(141, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Cross-bleed starts.', 'Ice test A.', 'External air starts.', 'All of the above.', 'c'),
(141, 256, 'mc', 'powerplant', 'If N1 overspeeds, the FADEC:', 'Fails and the other FADEC takes over.', 'Presents the FADEC NO DISP EICAS.', 'Automatically shuts down the engine.', 'All of the above.', 'c'),
(141, 267, 'mc', 'powerplant', 'Select the correct statement regarding an "ATS SOV OPEN" caution.', 'Shut the engine down and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the ATS SOV OPEN QRH.', 'Leave the engine running and call for the Abnormal Engine Start QRH.', 'Shut the engine down immediately and call maintenance.', 'b'),
(141, 261, 'mc', 'powerplant', 'Engine oil quantity can be monitored on the:', 'MFD takeoff page.', 'EICAS.', 'RMU maintenance page.', 'MFD Hydraulic page.', 'a'),
(141, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'The FADEC reduces the thrust to idle automatically.', 'There is no automatic reaction.', 'The engine shuts down automatically.', 'The thrust reverser stows automatically.', 'a'),
(141, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'b'),
(141, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the ADCs.', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'All of the above.', 'a'),
(141, 280, 'c2', 'stall_prot', 'The stick shaker activates:', 'At 130 KIAS.', 'When the low speed awareness tape is in the amber range.', 'When the aircraft symbol touches the PLI.', 'B and C are correct.', 'd'),
(141, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'LAV SMOKE', 'E1(2) EXTBL A(B) INOP', 'APU Fire Loop Fail', 'BAGG SMOKE', 'd'),
(141, 286, 'mc', 'mandatory', 'Which of the following is the required configuartion for the first half of the B Ice test', 'Bleeds OFF, Packs OFF, Crossbleed ALL', 'Bleeds Open, Packs Open, Crossbleed ALL', 'Bleeds OFF, Packs ON, Crossbleed AUTO', 'Bleeds OFF, Packs OFF, Crossbleed AUTO', 'c'),
(141, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'All three bleed valves must be closed.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'The engine bleed valves must be open.', 'The engine thrust must be at a minimum of 83% N1.', 'c'),
(142, 26, 'mc', 'air_condition', 'What does the EICAS PACK OVHT indicate?', 'The air leaving the pack is too hot.', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The air entering the compressor is too hot.', 'a'),
(142, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs stay on.', 'Only pack 2 turns off.', 'Both packs turn off.', 'All of the above.', 'c'),
(142, 35, 'mc', 'apu', 'The APU''s logic commands an automatic shutdown for which of the following conditions in flight?', 'Fire.', 'Overtemperature.', 'Overspeed.', 'All of the above.', 'c'),
(142, 34, 'mc', 'apu', 'The proper way to shut down the APU is to:', 'Close the APU bleed valves, wait 3 minutes, press the stop button, then turn the master knob to OFF.', 'Press the FUEL SHUTOFF button.', 'Press the stop button, wait until 0% rotation, then turn the master knob to OFF.', 'Turn the master knob to OFF.', 'c'),
(142, 44, 'mc', 'autopilot', 'When selected, low bank is equal to ____ : ?', '14 degrees.', '10 degrees.', '13 degrees above FL250.', '27 degrees.', 'a'),
(142, 54, 'mc', 'autopilot', 'The FMA displays what messages after pressing the TOGA buttons on the ground?', 'ROL/TO', 'HDG/TO', 'ROL/VS', 'ROL/GA', 'a'),
(142, 61, 'mc', 'crew_awareness', 'The flight data recorder is activated (starts recording):', 'As soon as the electrical system is powered.', 'By a 5G impact or immersion in water.', 'By turning on the red beacon', 'By turning on the NAV lights.', 'c'),
(142, 79, 'c2', 'crew_awareness', 'If an air data computer fails:', 'The standby airspeed indicator becomes unreliable.', 'A red failure indications appears on the airspeed tape, altitude tape and red boxed VS on the VSI indicator.', 'The ADC button on the reversionary panel should be pressed per the QRH.', 'B and C are correct.', 'd'),
(142, 11, 'mc', 'elec', 'Which components are energized in essential power configuration?', 'DC bus 1 and DC bus 2', 'The hot battery busses, essential busses, and the central DC bus.', 'All electrical busses except the shed busses.', 'All of the above.', 'b'),
(142, 90, 'tf', 'elec', 'The ground service bus is not powered when the GPU is selected.', 'TRUE', 'FALSE', '', '', 'a'),
(142, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the shed buses', 'Is charged by the esential busses', 'Is charged only when the ELT switch is in the ARM position.', 'Is not charged.', 'd'),
(142, 8, 'mc', 'elec', 'In essential power configuration (w/ loss of all generators):', 'The FMS remains powered.', 'VOR-DME approaches can be flown using the standby instruments.', 'VOR (no DME) can be flown using the RMU navigation page', 'VOR approaches are impossible since the PFD is blank.', 'c'),
(142, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'a'),
(142, 111, 'mc', 'fire_prot', 'How does pulling a fire handle affect the hydraulic system?', 'Closes the associated hydraulic shutoff valve.', 'Has no effect on the hydraulic system.', 'Turns off the associated electric hydraulic pump  - if it is operating.', 'Shuts off all hydraulic pressure on the associated side.', 'a'),
(142, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', '1 Halon fire bottle for the lavatory waste basket', 'A and C are correct.', 'd');
INSERT INTO `usedQuestions` (`genTestID`, `questionID`, `type`, `subcategory`, `questionText`, `a`, `b`, `c`, `d`, `answerKey`) VALUES
(142, 123, 'mc', 'flt_control', 'Elevator trim is accomplished by:', 'Positioning the spring and fixed tabs on the trailing edges of the elevator.', 'Positioning the fixed trim tab; the spring tab is a servo tab only.', 'Positioning the elevator with the main or backup trim switches.', 'Positioning the horizontal stabilizer.', 'd'),
(142, 129, 'c2', 'flt_control', 'ExpressJet allows takeoffs to be made with the following flap settings:', '22 Degrees.', '9 Degrees.', '18 Degrees.', 'B and C are correct.', 'd'),
(142, 136, 'mc', 'fuel', 'To balance fuel:', 'Turn the pump in the low tank off.', 'Transfer fuel from the high tank to the low tank using the ejector pump.', 'Turn the crossfeed knob to LOW 1 if tank 1has less fuel.', 'All of the above.', 'c'),
(142, 139, 'mc', 'fuel', 'Selecting crossfeed to Low 1 will result in:', 'Closing the fuel shutoff value in tank 2.', 'De-energizing the boost pumps in tank 2.', 'De-energizing the boost pumps in tank 1.', 'Closing the fuel shutoff value in tank 1.', 'c'),
(142, 152, 'nc', 'hydraulics', 'The hydraulic system quantity can be monitored on the:', 'The RMU Engine page 1.', 'EICAS.', 'MFD ECS/AI page.', 'None of the above.', 'd'),
(142, 146, 'mc', 'hydraulics', 'In normal cruise flight conditions, the electric hydraulic pumps are producing:', '0 psi.', '1600 psi.', '3000 psi.', '2900 psi.', 'a'),
(142, 165, 'mc', 'ice_rain_prot', 'Pitot/static tube #3 receives electrical heating from :', 'DC Bus 1.', 'The shed bus.', 'The essential buses.', 'DC Bus 2.', 'c'),
(142, 161, 'mc', 'ice_rain_prot', 'How is the XR anti-ice system different?', 'The vertical stabilizer is heated.', 'There are clear ice-detectors on the wings.', 'The XR has boots.', 'All of the above.', 'b'),
(142, 160, 'mc', 'ice_rain_prot', 'When is engine lip anti-ice required?', 'Whenever the temperature is 10 C or less.', 'Whenever the temperature is 10 C or less and visible moisture is present.', 'Whenever visible moisture is present.', 'None of the above.', 'b'),
(142, 168, 'mc', 'ice_rain_prot', 'When taking off into icing conditions:', 'The use of packs is only permitted if the APU bleed is available.', 'Pack 1 is off, Pack 2 is on.', 'The engines bleeds will always be closed.', 'The engine bleeds should be selected open.', 'd'),
(142, 181, 'mc', 'ldg_gear_brk', 'The maximum landing gear retraction speed is:', '320 KIAS or M 0.78.', '250 KIAS.', '200 KIAS.', '145 KIAS.', 'c'),
(142, 186, 'mc', 'ldg_gear_brk', 'When operating the emergency brakes, hydraulic pressure is applied to:', 'The main & nose gear brakes.', 'The inboard brakes only.', 'All main gear brakes.', 'None of the above.', 'c'),
(142, 199, 'mc', 'lighting', 'Aisle path lighting in the XR consists of:', 'There is no aisle path lighting.', 'Red and white lights powered by the backup battery.', 'Photo luminescent lighting.', 'All of the above.', 'c'),
(142, 58, 'tf', 'lighting', 'The flight attendant can override the cockpit switch and turn the emergency lights on, regardless of the emergency light switch position in the cockpit.', 'TRUE', 'FALSE', '', '', 'a'),
(142, 121, 'mc', 'limitations', 'The maximum airspeed with flaps 18 is:', '250 KIAS.', '140 KIAS.', '160 KIAS.', '200 KIAS.', 'd'),
(142, 218, 'mc', 'limitations', 'What is the maximum altitude for starting the APU?', 'FL370.', 'FL200.', 'FL300.', 'FL350.', 'c'),
(142, 213, 'mc', 'limitations', 'The maximum static air temperature (SAT) at FL370 is ___.', '-21.5 C.', '35 C.', '-65 C.', '9 C.', 'a'),
(142, 216, 'mc', 'limitations', 'The maximum permitted fuel imbalance between wing tanks is ___.', '800 lbs.', '900 lbs.', 'No maximum exists provided the roll trim is operative.', '100 lbs.', 'a'),
(142, 219, 'mc', 'limitations', 'The maximum load on the APU generator above FL300 is:', '350 amps.', '300 amps.', '250 amps.', '400 amps.', 'b'),
(142, 231, 'mc', 'oxy', 'In the XR with passenger oxygen masks in AUTO, the oxygen masks drop at:', '14,500'' +/- 500 cabin altitude.', '14,000'' MSL.', '10,000'' cabin altitude.', '14,000'' AGL.', 'a'),
(142, 230, 'tf', 'oxy', 'When the passenger masks fall, the oxygen flow starts without the passengers taking any action.', 'TRUE', 'FALSE', '', '', 'b'),
(142, 248, 'mc', 'pneum', '14th stage air is used for all of the above except...', 'Low power settings.', 'External air starts.', 'Ice test A.', 'Cross-bleed starts.', 'b'),
(142, 243, 'mc', 'pneum', 'The EICAS warning BLD 1(2) OVTEMP indicates that:', 'A massive leak detector has detected a bleed leak.', 'Air after the compressor is too hot.', 'Air leaving the pre-cooler is too hot.', 'The air leaving the pack is too hot.', 'c'),
(142, 242, 'mc', 'pneum', 'In normal cruise flight conditions, the crossbleed knob is in ___ and the crossbleed valve ___.', 'AUTO, closed.', 'OPEN, open.', 'CLOSED, closed.', 'AUTO, open.', 'a'),
(142, 240, 'mc', 'pneum', 'With the APU bleed valve selected OPEN, if engine 1 bleed valve is also opened,', 'Both valves close.', 'Both valves can be open at the same time.', 'The engine bleed valve closes.', 'The APU bleed valve closes.', 'd'),
(142, 260, 'mc', 'powerplant', 'Engine FADECs are powered by...', 'The essential buses.', 'The essential buses or the PMA depending on N2 RPM.', 'The essential buses during an electrical emergency.', 'The PMA only.', 'b'),
(142, 249, 'mc', 'powerplant', 'If a thrust-reverser deploys in flight:', 'There is no automatic reaction.', 'The thrust reverser stows automatically.', 'The engine shuts down automatically.', 'The FADEC reduces the thrust to idle automatically.', 'd'),
(142, 252, 'mc', 'powerplant', 'What are the three selectable thrust ratings for takeoff in the XR?', 'TO, ETO, TO RSV.', 'ALT TO, TO, ETO.', 'ETO, TO RSV, ETO RSV.', 'ALT TO TO, TO RSV, ETO RSV.', 'b'),
(142, 257, 'mc', 'powerplant', 'Maximum ITT for engine start on an A1/P engine is:', '868 C.', '800 C.', '901 C.', '506 C.', 'b'),
(142, 273, 'mc', 'pressurization', 'During an icing takeoff, the aircraft will begin to pressurize...', 'Immediately to 300 feet below current altitude once thrust is set for takeoff.', 'Immediately to 0.2 PSID below current altitude once thrust is set for takeoff.', 'Immediately after the PACKs are selected during the after takeoff flow.', 'The pneumatic/electropneumatic outflow valves are closed and allow for -0.1 pressurization when thust is set.', 'c'),
(142, 269, 'mc', 'pressurization', 'The purpose of the FADEC/Pressurization static port is to:', 'Provide static information to the standby airspeed and standby altimeter/ISIS.', 'Underpressure/overpressure relief should the cabin exceed 8.1 PSI or -0.3 PSI.', 'Provide static information to the CPAM.', 'Provide static information to the ADCs.', 'b'),
(142, 282, 'mc', 'stall_prot', 'The caution SPS ADVANCED means:', 'Is a normal message when flying through icing conditions and can only be reset on the ground when performing the SPS test.', 'Stick shaker and pusher actuation is set to lower angles of attack (higher speeds) due to some type of system failure.', 'Stick shaker and pusher actuation is set to higher angles of attack (lower speeds) due to some type of system failure.', 'None of the above.', 'b'),
(142, 163, 'mc', 'mandatory', 'To perform the A ice protection test:', 'The engine bleed valves must be open.', 'Engine, wing, and stab anti-ice must be selected OFF.', 'All three bleed valves must be closed.', 'The engine thrust must be at a minimum of 83% N1.', 'a'),
(142, 157, 'mc', 'mandatory', 'The following indications reflect a successful hydraulic system test:', 'Electric pumps to AUTO, 2900 psi +/- 200.', 'Engine driven pumps producing pressure when engines are at 56.4 N2.', 'Electric pumps to ON, 1600 psi.', 'Electric pumps to AUTO, 3000 psi +/- 200.', 'a'),
(142, 113, 'mc', 'mandatory', 'Which of the following messages would indicate a good fire test?', 'BAGG SMOKE', 'E1(2) EXTBL A(B) INOP', 'APU Fire Loop Fail', 'None of the above.', 'a'),
(143, 27, 'c2', 'air_condition', 'What is a pack overload?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd'),
(143, 26, 'mc', 'air_condition', 'What is a pack overheat?', 'The air leaving the pack is too hot.', 'The air entering the pack is too hot.', 'The air leaving the compressor is too hot.', 'The air entering the compressor is too hot.', 'a'),
(143, 28, 'mc', 'air_condition', 'During a go-around at 200 AGL...', 'Both packs turn off.', 'Both packs stay on.', 'Only pack 1 turns off.', 'All of the above.', 'a'),
(143, 25, 'mc', 'air_condition', 'At 2000 AGL in CLB thrust mode, icing conditions, both packs selected ON:', 'Pack 2 is on, 1 is off.', 'Pack 1 is on, 2 is off.', 'Both packs are on.', 'Both packs are off.', 'a'),
(144, 27, 'c2', 'air_condition', 'What does the EICAS PACK OVLD indicate?', 'The air leaving the compressor is too hot.', 'The pressure of air entering the pack is too high.', 'The air entering the pack is too hot.', 'A and B are correct.', 'd'),
(144, 25, 'mc', 'air_condition', 'While flying in icing conditions at 2000 AGL in CLB thrust with packs selected ON:', 'Both packs are on.', 'Pack 1 is on, 2 is off.', 'Pack 2 is on, 1 is off.', 'Both packs are off.', 'c'),
(144, 30, 'mc', 'acft_gen', 'The EMB-145 is approximately ...', '89 feet in length.', '160 % of the length of an EMB-135.', '98 feet in length.', '110 feet in length.', 'c'),
(144, 9, 'mc', 'apu', 'The APU (Model T-62T-40C14) is controlled by a(n):', 'Starter/Generator', 'FADEC', 'Manual controls', 'EICAS', 'b'),
(144, 2, 'mc', 'apu', 'The minimum battery temperature for an APU start is:', '54 C', '70 C', '-20 C', '40 C', 'c'),
(144, 44, 'mc', 'autopilot', 'When selected, low bank is equal to ____ : ?', '27 degrees.', '13 degrees above FL250.', '14 degrees.', '10 degrees.', 'c'),
(144, 47, 'mc', 'autopilot', 'What vertical speed does FLC give you in a descent above 12,000 feet?', '1,000 feet per minute.', '3 degree glidepath.', '2,000 feet per minute.', '3,000 feet per minute.', 'c'),
(144, 53, 'mc', 'autopilot', 'Crews must always verify that the autopilot is coupled to the PF by looking at the:', 'Flight Mode Anunciator (FMA).', 'Flight Guidance Controller', 'Display Control Panel', 'Flight Director button on the Flight Guidance Control Panel', 'a'),
(144, 54, 'mc', 'autopilot', 'The FMA displays what messages after pressing the TOGA buttons on the ground?', 'HDG/TO', 'ROL/TO', 'ROL/GA', 'None of the above.', 'b'),
(144, 43, 'c2', 'autopilot', 'On the ground, pressing the TOGA buttons will position the command bars to:', '14 degrees pitch up attitude (Flaps 18).', '14 degrees pitch up attitude (Flaps 9).', '13 degrees pitch up attitude (Flaps 18).', 'B and C are correct.', 'd'),
(144, 64, 'mc', 'crew_awareness', 'How many transponders are on the aircraft?', '2', '1', '3', 'All of the above.', 'a'),
(144, 83, 'tf', 'crew_awareness', 'The EICAS reversionary buttons must be pressed to activate DAU channel B.', 'TRUE', 'FALSE', '', '', 'a'),
(144, 59, 'tf', 'crew_awareness', 'The tuning backup control head (TBCH) remains powered in essential power.', 'TRUE', 'FALSE', '', '', 'b'),
(144, 84, 'tf', 'crew_awareness', 'During a decreasing performance windshear warning, the aircraft should immediately be re-configured to: Gear Up / Flaps 9.', 'TRUE', 'FALSE', '', '', 'b'),
(144, 86, 'mc', 'crew_awareness', '"CAS MSG" on your PFD indicates:', 'A disagreement between IC-600''s on EICAS messages displayed.', 'IAS displayed on each PFD differs by more than 5 knots.', 'SG reversion has been selected.', 'All of the above.', 'a'),
(144, 78, 'mc', 'crew_awareness', 'An amber HDG indication on the PFD indicates:', 'The heading system has failed.', 'Check your heading, you''re drifting from the assigned heading.', 'A difference of 6 degrees between the left and right AHRS headings.', 'The FMS is suggesting heading select navigation.', 'c'),
(144, 81, 'mc', 'crew_awareness', 'The power source for SG 2 is:', 'Essential bus 2', 'DC Bus 2', 'DC bus 1', 'All of the above.', 'b'),
(144, 82, 'mc', 'crew_awareness', 'Standby instruments receive information from which pitot static source?', 'Pitot/Static tube 3', 'Pitot 2/Static ports 2 & 3.', 'Pitot 1/Static ports 1 & 4.', 'Pitot 1/Fadec pressurization static port.', 'a'),
(144, 80, 'mc', 'crew_awareness', 'In essential power, the EICAS:', 'Is automatically displayed on RMU 1', 'Is powered normally.', 'Can be presented by using MFD reversion.', 'All of the above.', 'b'),
(144, 57, 'mc', 'crew_awareness', 'The following doors open in flight cause a master warning:', 'Main cabin door only.', 'Over-wing emergency exit.', 'Main and service doors.', 'None of the above.', 'c'),
(144, 94, 'tf', 'elec', 'With a loss of generator 1 and the APU off, the aircraft still has 2 independent electrical systems.', 'TRUE', 'FALSE', '', '', 'b'),
(144, 99, 'mc', 'elec', 'The backup battery button on the electrical panel...', 'Opens the BBC, isolating the backup battery hot bus.', 'Removes power from the backup flight instruments.', 'Is pushed during an electrical emergency to backup EDL logic.', 'Allows a test of the ISIS on LR aircraft.', 'a'),
(144, 92, 'c2', 'elec', 'The shed buses are powered:', 'With the APU off, one engine shut down and the shed bus knob in AUTO.', 'With 3 generators on-line, shed bus knob in AUTO, on the ground.', 'With the GPU selected, shed bus knob in AUTO or OVRD.', 'B and C are correct.', 'd'),
(144, 1, 'tf', 'elec', 'The emergency light system will never activate when the emergency light switch is in the "OFF" position.', 'TRUE', 'FALSE', '', '', 'b'),
(144, 97, 'mc', 'elec', 'The backup battery provides power for:', 'The GCUs, EDL and FADECs.', 'The GCUs, EDL and on XR aircraft, the ISIS.', 'The GCUs, EDL and RMU 1 if IC-600 1 fails.', 'None of the above.', 'b'),
(144, 101, 'mc', 'elec', 'With GPU power available and selected:', 'BC 1 and BC 2 are open.', 'BTC 1 & 2 are open.', 'The ALC is closed if the APU has been started.', 'BC 1 and BC 2 are closed.', 'a'),
(144, 100, 'mc', 'elec', 'The EICAS message ELEC ESS XFR FAIL means:', 'Is normal during a loss of all generators.', 'You are not in the essential power configuration but should be.', 'You have one electrical system despite having 4 or more generators on-line.', 'You are in essential power configuration but should not be.', 'b'),
(144, 76, 'mc', 'elec', 'The ELT battery:', 'Is charged by the esential busses', 'Is charged only when the ELT switch is in the ARM position.', 'Is not charged.', 'None of the above.', 'c'),
(144, 98, 'mc', 'elec', 'The electrical system is made up of...', 'Five, 24 Volt DC generators.', 'Four, 28 Volt DC generators.', 'Five, 28 Volt DC generators.', 'Four, 24 Volt DC generators.', 'c'),
(144, 89, 'mc', 'elec', 'In flight, the NICAD batteries supply the electrical power for ___ minutes while on essential power.', '40 minutes.', '15 minutes.', '25 minutes.', '20 minutes.', 'a'),
(144, 103, 'mc', 'emerg_equip', 'On the EMB 145, we have the following emergency equipment in the aircraft.', '4 flashlights, 50 life vests, 2 oxygen deploy tools.', '3 Halon fire extinguishers, 3 PBEs, 1 H20 fire extinguisher.', 'First Aid Kit, 2 PBEs, 2 H20 fire extinguishers.', '2 Halon fire extinguishers, 4 flashlights, 1 Oxygen deploy tool', 'b'),
(144, 102, 'mc', 'emerg_equip', 'The 145 is required to have a total of:', '2 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 1 portable O2 bottle.', '3 Halon fire extinguishers, 3 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', '2 Halon fire extinguishers, 3 PBEs, 2 H2O fire extinguishers, no portable O2 bottle(s).', '3 Halon fire extinguishers, 2 PBEs, 1 H2O fire extinguisher, 2 portable O2 bottles.', 'b'),
(144, 112, 'c2', 'fire_prot', 'Pressing the APU fire extinguishing button:', 'Shuts down the APU and discharges the fire extinguisher after a 10 second delay.', 'Closes the APU fuel shutoff valve.', 'Discharges the APU fire bottle.', 'B and C are correct.', 'd'),
(144, 110, 'ac', 'fire_prot', 'Pulling the fire extinguishing handle closes:', 'The fuel shutoff valve.', 'The hydraulic shutoff valve to the engine-driven hydraulic pump.', 'The engine bleed and lip anti-ice ice valves.', 'All of the above.', 'd'),
(144, 23, 'nc', 'fire_prot', 'If the lavatory halon bottle discharges:', 'The flight attendant hears a warning horn.', 'The LAV SMOKE EICAS warning appears.', 'The LAV BOTTLE INOP EICAS warning appears.', 'None of the above.', 'd'),
(144, 115, 'c2', 'fire_prot', 'The aircraft has a total of..', '1 Halon fire bottle for the APU', '1 Halon fire bottle for the lavatory waste basket', '2 Halon fire bottles for the engines and 2 Halon fire bottles for the APU.', 'A and B are correct.', 'd'),
(144, 130, 'c2', 'flt_control', 'ExpressJet allows landings to be made with the following flap settings:', '22 Degrees.', '18 Degrees.', '45 Degrees.', 'A and C are correct.', 'd'),
(144, 122, 'mc', 'flt_control', 'The speedbrakes do not open if:', 'The flaps are extended to 22 degrees.', 'The gear is down.', 'Hydraulic system 1 fails.', 'All of the above.', 'a'),
(144, 119, 'mc', 'flt_control', 'The electromechanical gust lock inserts locking pins into:', 'Inboard spoilers while in flight.', 'Elevator', 'Ailerons.', 'Rudder.', 'b'),
(144, 117, 'tf', 'flt_control', 'The rudder PCU is powered by both hydraulic systems below 135 knots.', 'TRUE', 'FALSE', '', '', 'a'),
(144, 131, 'mc', 'flt_control', 'The caution "Rudder Overboost" means:', 'Rudder hydraulic system 1 is still on above 135 KIAS.', 'The rudder is in manual reversion.', 'The deflection is 5 degrees +/- 1 degree.', 'The pilot has exceeded 135 lbs. of pressure on the rudder pedal.', 'a'),
(144, 140, 'mc', 'fuel', 'In essential power:', 'All fuel boost pumps are available.', 'No fuel boost pumps are available.', 'Only the C fuel boost pumps are available.', 'Only the A and B fuel boost pumps are available.', 'd'),
(144, 137, 'tf', 'fuel', 'The ventral tank fuel transfer can take place while crossfeeding.', 'TRUE', 'FALSE', '', '', 'b'),
(144, 133, 'mc', 'fuel', 'The fuel temperature on the MFD is measured at:', 'The left fuel tank.', 'Each fuel tank.', 'The FCOC.', 'The ACOC.', 'a'),
(144, 142, 'mc', 'fuel', 'Assuming useable fuel in an XR''s ventral tank, fuel transfer will automatically occur in the auto mode when ...', 'Both wing tanks reach 4630 lbs + 30 seconds.', 'One wing tank reaches 4630 lbs + 30 seconds.', 'One wing tank reaches 1863 lbs.', 'The FMS shows fuel remaining on arrival of less than 1800 lbs.', 'a'),
